INSERT INTO `Skills` VALUES
(1,'LL01-046',NULL,0,26,'【ライブ参加時】「穂乃果」以外の『２年生』と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with a \"2nd Year\" card other than \"Honoka\" cards, gain +[ALL].'),
(2,'LL01-047',NULL,0,26,'【ライブ参加時】「絵里」以外の『３年生』と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with a \"3rd Year\" card other than \"Eli\" cards, gain +[ALL].'),
(3,'LL01-048',NULL,0,26,'【ライブ参加時】「ことり」以外の『２年生』と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with a \"2nd Year\" card other than \"Kotori\" cards, gain +[ALL].'),
(4,'LL01-049',NULL,0,26,'【ライブ参加時】「海未」以外の『２年生』と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with a \"2nd Year\" card other than \"Umi\" cards, gain +[ALL].'),
(5,'LL01-050',NULL,0,26,'【ライブ参加時】「凛」以外の『１年生』と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with a \"1st Year\" card other than \"Rin\" cards, gain +[ALL].'),
(6,'LL01-051',NULL,0,26,'【ライブ参加時】「真姫」以外の『１年生』と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with a \"1st Year\" card other than \"Maki\" cards, gain +[ALL].'),
(7,'LL01-052',NULL,0,26,'【ライブ参加時】「希」以外の『３年生』と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with a \"3rd Year\" card other than \"Nozomi\" cards, gain +[ALL].'),
(8,'LL01-053',NULL,0,26,'【ライブ参加時】「花陽」以外の『１年生』と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with a \"1st Year\" card other than \"Hanayo\" cards, gain +[ALL].'),
(9,'LL01-054',NULL,0,26,'【ライブ参加時】「にこ」以外の『３年生』と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with a \"3rd Year\" card other than \"Nico\" cards, gain +[ALL].'),
(10,'LL01-055',NULL,0,11,'【登場時】あなたの手札がどのあいてよりも少ないなら、《勧誘》する。 （手札が４枚になるまでカードを引く。手札がすでに４枚以上あるなら、カードを引かない。）','[Entry] If you have less cards in your Hand than any of the other players, ⟪SCOUT⟫.'),
(11,'LL01-056',NULL,0,27,'【ライブ参加時】あなたがすでに獲得ライブPが４点以上の楽曲カードをライブ中なら、＋【青】【青】する。（基本ライブＰと追加ライブＰを合計した点数を見る。）','[Live Join] If you already performed a Live worth four or more Live Points, gain +[COOL][COOL]. (Both Base and Bonus Live Points are counted.)'),
(12,'LL01-057',NULL,0,13,'【登場時】あなたのデッキの１番上のカードを表向きにする。表向きにしたメンバーがライブ衣装で【☆】を持つなら、手札に加える。表向きにしたメンバーがライブ衣装で【☆】を持たないなら、それを《登場》する。','[Entry] Flip the top card of your Deck. If it\'s a Member with Stars, add the card to your Hand. If it\'s a Member without Stars, ⟪ENTER⟫ them.'),
(13,'LL01-058',NULL,0,14,'【登場時】次にターンを行うあいてはあなたの手札を見ないで１枚選び、あなたはそれを全員に見せる。そのメンバーが【☆】を持たないなら、《登場》する。そうでないなら、それを手札に戻す。','[Entry] The next player in turn order randomly picks one card from your Hand without looking. Show it to all players. If the card is a Member without Stars, ⟪ENTER⟫ them. If not, return the card to your Hand.'),
(14,'LL01-059',NULL,0,28,'【ライブ参加時】あなたのライブ中の楽曲カードが２枚以上あるなら、＋【オール】する。（このメンバーが参加する《ライブ》は枚数に含めない。）','[Live Join] If you already performed two or more Lives, gain +[ALL]. (The ⟪LIVE⟫ this Member is joining does not count.)'),
(15,'LL01-060',NULL,0,15,'【登場時】あなたのセットリストにある裏向きのカード１枚を表向きにする。','[Entry] Flip one Song card in your Set List face-up.'),
(16,'LL01-061',NULL,0,78,'【登場時】カードを２枚引く。その後、手札１枚を裏向きでデッキの１番上か１番下に置く。','[Entry] Draw two cards. Then, return one card from your Hand to the bottom or the top of your Deck.'),
(17,'LL01-062',NULL,0,29,'【ライブ参加時】共通スコアの楽曲カードの《ライブ》に参加するなら、＋【緑】【緑】【緑】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with an Any Piece requirement, gain +[PURE][PURE][PURE].'),
(18,'LL01-063',NULL,0,16,'【登場時】あなたのライブPがどのあいてよりも低いなら、デッキの１番上のカードを《登場》する。','[Entry] If you have less Live Points than any of the other players, ⟪ENTER⟫ the top card of your Deck.'),
(19,'LL01-063',NULL,1,53,'【ライブ参加時】あなたのライブＰがどのあいてよりも高いなら、＋【赤】する。','[Live Join] If you have more Live Points than any of the other players, gain +[SMILE].'),
(20,'LL01-064',NULL,0,41,'【ライブ中】この《ライブ》に参加している、ライブ衣装が「{{costume:夏色えがおで1,2,Jump！}}」の名前が異なるメンバー３人につき、♪ライブP＋３♪する。','[While Live] For every three differently named Members with the \"{{costume:Natsuiro Egao de 1,2,Jump!}}\" Live Costume joining this ⟪LIVE⟫, gain ♪Live Points +3♪.'),
(21,'LL01-065',NULL,0,42,'【ライブ参加時】この《ライブ》に参加する、ライブ衣装が「{{costume:もぎゅっと“love”で接近中！}}」の名前が異なるメンバー１人につき、共通スコアが１減る。','[Live Join] For each differently named Member with the \"{{costume:Mogyutto “love” de Sekkin chuu!}}\" Live Costume joining this ⟪LIVE⟫, the Any Piece requirement is reduced by 1.'),
(22,'LL01-066',NULL,0,201,'大好きだばんざーい！','Daisuki da banzai!'),
(23,'LL01-066',NULL,1,202,'頑張れるから　昨日に手をふって　ほら前向いて','Ganbareru kara kinou ni te o futte hora mae muite'),
(24,'LL01-067',NULL,0,203,'ただの思い出　それだけじゃいやだよ','Tada no omoide sore dake ja iya da yo'),
(25,'LL01-067',NULL,1,204,'精一杯　力の限り走るんだ（Chance for me! Chance for you!）','Seiippai chikara no kagiri hashirunda (Chance for me! Chance for you!)'),
(26,'LL01-068',NULL,0,205,'嬉しいから　君に会いに行こう','Ureshii kara kimi ni ai ni ikou'),
(27,'LL01-068',NULL,1,206,'寂しいから　君に会いに行こう（会いに行くよ）','Sabishii kara kimi ni ai ni ikou (Ai ni iku yo)'),
(28,'LL01-069',NULL,0,207,'だって可能性感じたんだ　そうだ…ススメ！','Datte kanousei kanjitanda sou da... susume!'),
(29,'LL01-069',NULL,1,208,'後悔したくない　目の前に僕らの道がある','Koukai shitakunai me no mae ni bokura no michi ga aru'),
(30,'LL01-070',NULL,0,43,'【ライブ成功時】もう１回ターンを行う。','[Live Success] Take another turn.'),
(31,'LL01-071',NULL,0,44,'【ライブ成功時】次のあなたのターンを１回休む。','[Live Success] Skip your next turn.'),
(32,'LL01-072',NULL,0,45,'【ライブ中】この《ライブ》に参加している全員が『１年生』で、名前が異なるメンバーが３人以上参加しているなら、♪ライブP＋１♪する。','[While Live] If there are three or more differently named Members joining this ⟪LIVE⟫, and all of them are \"1st Year\" cards, gain ♪Live Points +1♪.'),
(33,'LL01-073',NULL,0,45,'【ライブ中】この《ライブ》に参加している全員が『３年生』で、名前が異なるメンバーが３人以上参加しているなら、♪ライブP＋１♪する。','[While Live] If there are three or more differently named Members joining this ⟪LIVE⟫, and all of them are \"3rd Year\" cards, gain ♪Live Points +1♪.'),
(34,'LL01-074',NULL,0,45,'【ライブ中】この《ライブ》に参加している全員が『２年生』で、名前が異なるメンバーが３人以上参加しているなら、♪ライブP＋１♪する。','[While Live] If there are three or more differently named Members joining this ⟪LIVE⟫, and all of them are \"2nd Year\" cards, gain ♪Live Points +1♪.'),
(35,'LL01-075',NULL,0,46,'【ライブ中】この《ライブ》に「穂乃果」「絵里」「ことり」「海未」「凛」「真姫」「希」「花陽」「にこ」が参加しているなら、♪ライブP＋９♪する。','[While Live] If \"Honoka\", \"Eli\", \"Kotori\", \"Umi\", \"Rin\", \"Maki\", \"Nozomi\", \"Hanayo\" and \"Nico\" joined this ⟪LIVE⟫, gain ♪Live Points +9♪.'),
(36,'LL02-046',NULL,0,30,'【ライブ参加時】「ことり」か「花陽」と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with a \"Kotori\" or \"Hanayo\" card, gain +[ALL].'),
(37,'LL02-047',NULL,0,30,'【ライブ参加時】「真姫」か「にこ」と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with a \"Maki\" or \"Nico\" card, gain +[ALL].'),
(38,'LL02-048',NULL,0,30,'【ライブ参加時】「穂乃果」か「花陽」と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with a \"Honoka\" or \"Hanayo\" card, gain +[ALL].'),
(39,'LL02-049',NULL,0,30,'【ライブ参加時】「凛」か「希」と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with a \"Rin\" or \"Nozomi\" card, gain +[ALL].'),
(40,'LL02-050',NULL,0,30,'【ライブ参加時】「海未」か「希」と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with an \"Umi\" or \"Nozomi\" card, gain +[ALL].'),
(41,'LL02-051',NULL,0,30,'【ライブ参加時】「絵里」か「にこ」と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with an \"Eli\" or \"Nico\" card, gain +[ALL].'),
(42,'LL02-052',NULL,0,30,'【ライブ参加時】「海未」か「凛」と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with an \"Umi\" or \"Rin\" card, gain +[ALL].'),
(43,'LL02-053',NULL,0,30,'【ライブ参加時】「穂乃果」か「ことり」と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with a \"Honoka\" or \"Kotori\" card, gain +[ALL].'),
(44,'LL02-054',NULL,0,30,'【ライブ参加時】「絵里」か「真姫」と《ライブ》に参加するなら、＋【オール】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with an \"Eli\" or \"Maki\" card, gain +[ALL].'),
(45,'LL02-055',NULL,0,17,'【登場時】あなたの手札を全員に見せてよい。そうして、見せた手札の中に「穂乃果」のカードが２枚以上あるなら、デッキの１番上のカードを《登場》する。（その後、手札を元に戻す。）','[Entry] You may show your Hand to all players. If you do and there are two or more \"Honoka\" cards in your Hand, ⟪ENTER⟫ the top card of your Deck. (Hide your Hand again after this.)'),
(46,'LL02-056',NULL,0,18,'【登場時】あなたの待機中の「絵里」（このメンバーも含む）１人を手札に戻す。そのメンバーが持つ【☆】１個につき、カードを１枚引く。','[Entry] Return an \"Eli\" card on Stand-By (including this Member) to your Hand. For each Star the returned Member has, draw one card.'),
(47,'LL02-057',NULL,0,31,'【ライブ参加時】この《ライブ》に参加しないあなたの待機中のメンバー１人を裏向きでデッキの１番下に置いてよい。そうしたら、＋【オール】する。下に置いたのが「ことり」なら、さらに＋【オール】する。','[Live Join] You may return one Member on Stand-By on your Stage, who is not joining this ⟪LIVE⟫, to the bottom of your Deck. If you do, gain +[ALL]. If the returned Member is \"Kotori\", gain another [ALL].'),
(48,'LL02-058',NULL,0,19,'【登場時】あなたは手札１枚を全員に見せて裏向きでデッキの１番下に置いてよい。そうしたら、カードを１枚引く。下に置いたのが「海未」なら、さらにカードを１枚引く。','[Entry] You may show one card from your Hand to all players, then return it to the bottom of your Deck and draw one card. If the shown card was an \"Umi\" card, draw another card.'),
(49,'LL02-059',NULL,0,20,'【登場時】【RUSH】によって《登場》したなら、デッキの１番上のカードを《登場》する。「凛」の【RUSH】によって《登場》したなら、さらにカードを１枚引く。（デッキから《登場》したメンバーの【登場時】より先にカードを１枚引く。）','[Entry] If this Member was ⟪ENTER⟫ed using [RUSH], ⟪ENTER⟫ the top card of your Deck. If this Member was ⟪ENTER⟫ed using [RUSH] from a \"Rin\" card, draw one card. (Draw before resolving the [Entry] Skill of the ⟪ENTER⟫ed card.)'),
(50,'LL02-060',NULL,0,21,'【登場時】「真姫」以外のあなたの待機中のメンバーがいるなら、その中の１人を手札に戻す。その後、デッキの１番上のカードを《登場》する。（メンバーを戻せなくても、デッキの１番上のカードを《登場》できる。）','[Entry] If there are any Members other than \"Maki\" on Stand-By on your Stage, return one of them to your Hand. After that, ⟪ENTER⟫ the top card of your Deck. (⟪ENTER⟫ even if you\'re not able to return a card.)'),
(51,'LL02-061',NULL,0,22,'【登場時】あなたのデッキの１番上のカードを表向きにする。表向きにしたメンバーがあなたの待機中のメンバーの誰かと同じ名前なら、《勧誘》する。（手札が４枚になるまでカードを引く。）','[Entry] Flip the top card of your Deck. If there is a Member on Stand-By on your Stage with the same name, ⟪SCOUT⟫.'),
(52,'LL02-062',NULL,0,23,'【登場時】あなたのデッキの１番上のカードを表向きにする。表向きにしたメンバーがあなたの待機中のすべてのメンバーと名前が異なるなら、それを《登場》する。表向きにしたメンバーが「花陽」なら、それを手札に加え、カードを１枚引く。','[Entry] Flip the top card of your Deck. If there are no Members on Stand-By on your Stage with the same name, ⟪ENTER⟫ it. If it\'s a \"Hanayo\" card, add it to your Hand and draw another card.'),
(53,'LL02-063',NULL,0,32,'【ライブ参加時】この《ライブ》に参加するメンバーカードの半分以上が「にこ」なら、＋【赤】する。','[Live Join] If half or more of the Members joining this ⟪LIVE⟫ are \"Nico\" cards, gain +[SMILE].'),
(54,'LL02-064',NULL,0,47,'【ライブ中】全員の目標ライブＰを＋１する。（もともとの目標ライブＰが９点なら、１０点になる。）','[While Live] Increase each player\'s Live Points goal by 1. (If you are using the recommended goal of 9 Live Points, you are now playing to 10 Live Points.)'),
(55,'LL02-065',NULL,0,48,'【ライブ成功時】この《ライブ》にライブ衣装が「{{costume:Wonderful Rush}}」の名前が異なるメンバーが２人以上参加しているなら、手札から【☆】を持たないメンバー１人を《登場》してよい。','[Live Success] If two or more differently named Members with the \"{{costume:Wonderful Rush}}\" Live Costume joined this ⟪LIVE⟫, you may ⟪ENTER⟫ one Member without Stars from your Hand.'),
(56,'LL02-066',NULL,0,7,'【ライブ成功時】カードを２枚引く。','[Live Success] Draw two cards.'),
(57,'LL02-067',NULL,0,49,'【ライブ中】この《ライブ》にメンバーが５人以上参加しているなら、♪ライブP＋１♪する。','[While Live] If five or more Members are joining this ⟪LIVE⟫, gain ♪Live Points +one♪.'),
(58,'LL02-068',NULL,0,50,'【ライブ中】あなたが５枚以上の楽曲カードをライブ中なら、♪ライブP＋１♪する。（ライブ成功後に楽曲カードの枚数が５枚以上になっても追加ライブＰがもらえる。）','[While Live] If there are five or more Song cards that are Live on your Stage, gain ♪Live Points +1♪. (You can gain the Bonus Live Point even after performing this ⟪LIVE⟫, if you get to five Live Song cards at a later point.)'),
(59,'LL02-069',NULL,0,209,'ユメノトビラ ずっと探し続けた','Yume no tobira zutto sagashi tsuzuketa'),
