(66,'LL02-073',NULL,0,52,'【ライブ中】この《ライブ》に参加している全員が「Printemps」のメンバー（「穂乃果」「ことり」「花陽」）で、３人全員がそろって参加しているなら、♪ライブP＋１♪する。','[While Live] If all Members joining this ⟪LIVE⟫ are part of \"Printemps\" (\"Honoka\", \"Kotori\" and \"Hanayo\"), and all three are joining, gain ♪Live Points +1♪.'),
(67,'LL02-074',NULL,0,52,'【ライブ中】この《ライブ》に参加している全員が「lily white」のメンバー（「海未」「凛」「希」）で、３人全員がそろって参加しているなら、♪ライブP＋１♪する。','[While Live] If all Members joining this ⟪LIVE⟫ are part of \"lily white\" (\"Umi\", \"Rin\" and \"Nozomi\"), and all three are joining, gain ♪Live Points +1♪.'),
(68,'LL02-075',NULL,0,52,'【ライブ中】この《ライブ》に参加している全員が「BiBi」のメンバー（「絵里」「真姫」「にこ」）で、３人全員がそろって参加しているなら、♪ライブP＋１♪する。','[While Live] If all Members joining this ⟪LIVE⟫ are part of \"BiBi\" (\"Eli\", \"Maki\" and \"Nico\"), and all three are joining, gain ♪Live Points +1♪.'),
(69,'LL03-046',NULL,0,33,'【ライブ参加時】この《ライブ》に参加するメンバーがすべて「穂乃果」なら、＋【オール】する。','[Live Join] If all of the Members joining this ⟪LIVE⟫ are \"Honoka\" cards, gain +[ALL].'),
(70,'LL03-047',NULL,0,33,'【ライブ参加時】この《ライブ》に参加するメンバーがすべて「絵里」なら、＋【オール】する。','[Live Join] If all of the Members joining this ⟪LIVE⟫ are \"Eli\" cards, gain +[ALL].'),
(71,'LL03-048',NULL,0,33,'【ライブ参加時】この《ライブ》に参加するメンバーがすべて「ことり」なら、＋【オール】する。','[Live Join] If all of the Members joining this ⟪LIVE⟫ are \"Kotori\" cards, gain +[ALL].'),
(72,'LL03-049',NULL,0,33,'【ライブ参加時】この《ライブ》に参加するメンバーがすべて「海未」なら、＋【オール】する。','[Live Join] If all of the Members joining this ⟪LIVE⟫ are \"Umi\" cards, gain +[ALL].'),
(73,'LL03-050',NULL,0,33,'【ライブ参加時】この《ライブ》に参加するメンバーがすべて「凛」なら、＋【オール】する。','[Live Join] If all of the Members joining this ⟪LIVE⟫ are \"Rin\" cards, gain +[ALL].'),
(74,'LL03-051',NULL,0,33,'【ライブ参加時】この《ライブ》に参加するメンバーがすべて「真姫」なら、＋【オール】する。','[Live Join] If all of the Members joining this ⟪LIVE⟫ are \"Maki\" cards, gain +[ALL].'),
(75,'LL03-052',NULL,0,33,'【ライブ参加時】この《ライブ》に参加するメンバーがすべて「希」なら、＋【オール】する。','[Live Join] If all of the Members joining this ⟪LIVE⟫ are \"Nozomi\" cards, gain +[ALL].'),
(76,'LL03-053',NULL,0,33,'【ライブ参加時】この《ライブ》に参加するメンバーがすべて「花陽」なら、＋【オール】する。','[Live Join] If all of the Members joining this ⟪LIVE⟫ are \"Hanayo\" cards, gain +[ALL].'),
(77,'LL03-054',NULL,0,33,'【ライブ参加時】この《ライブ》に参加するメンバーがすべて「にこ」なら、＋【オール】する。','[Live Join] If all of the Members joining this ⟪LIVE⟫ are \"Nico\" cards, gain +[ALL].'),
(78,'LL03-055',NULL,0,34,'【ライブ参加時】【RUSH】によって《登場》し、自身の【LIVE】によって《ライブ》するなら、＋【オール】する。','[Live Join] If this Member was ⟪ENTER⟫ed using [RUSH], and joins a ⟪LIVE⟫ using their own [LIVE], gain +[ALL].'),
(79,'LL03-056',NULL,0,35,'【ライブ参加時】基本ライブPが３点以上の楽曲カードの《ライブ》に参加するなら、＋【オール】する。','[Live Join] If the Song card used for this ⟪LIVE⟫ has three or more Base Live Points, gain +[ALL].'),
(80,'LL03-057',NULL,0,36,'【ライブ参加時】この《ライブ》に参加する、ライブ衣装のメンバー全員に＋【オール】する。','[Live Join] All Members with a Live Costume joining this ⟪LIVE⟫ gain +[ALL].'),
(81,'LL03-058',NULL,0,24,'【登場時】あなたのセットリストにある表向きの楽曲カードが３枚になるまで、裏向きのカードを表向きにする。その後、あなたのセットリストにある表向きの楽曲カードが３色以上あるなら、デッキの１番上のカードを《登場》する。','[Entry] Flip cards in your Set List face-up until you have three face-up Song cards. If the face-up Song cards in your Set List have three or more different Attributes, ⟪ENTER⟫ the top card of your Deck.'),
(82,'LL03-059',NULL,0,37,'【ライブ参加時】この《ライブ》に参加しないあなたの待機中のメンバー１人を手札に戻してよい。そうしたら、＋【オール】する。','[Live Join] You may return one of your Members on Stand-By who is not joining this ⟪LIVE⟫ to your Hand. If you do, gain +[ALL].'),
(83,'LL03-060',NULL,0,25,'【登場時】あなたのセットリストにある色が異なる表向きの楽曲カード１枚につき、カードを１枚引く。その後、あなたの手札が４枚以上あるなら、このメンバーを参加させて《ライブ》してよい。','[Entry] For each different Attribute of the face-up Song cards in your Set List, draw one card. If you have four or more cards in your Hand after this, you may perform a ⟪LIVE⟫ with this Member.'),
(84,'LL03-061',NULL,0,38,'【ライブ参加時】あなたは手札２枚を好きな順番で裏向きでデッキの１番下に置いてよい。そうしたら、この《ライブ》に参加する自身以外のメンバー１人に、＋【オール】【オール】する。','[Live Join] You may return two cards from your Hand to the bottom of your Deck. If you do, one other Member joining this ⟪LIVE⟫ gains +[ALL][ALL].'),
(85,'LL03-062',NULL,0,39,'【ライブ参加時】あなたかあいてのライブ中のメンバーのなかに【☆】を３個以上持つメンバーがいるなら、＋【オール】【オール】する。','[Live Join] If there is a Member with three Stars or more in any of your or the other player\'s Lives, gain +[ALL][ALL].'),
(86,'LL03-063',NULL,0,40,'【ライブ参加時】あなたのライブＰが２点以上で、このメンバーが参加する《ライブ》の楽曲カードが通常スコアでスキルがないなら、それのスコアを【２２２】にしてよい。','[Live Join] If you have two or more Live Points and this Member is joining a ⟪LIVE⟫ with Attribute Piece requirements, you may change the Attribute Piece requirement to [222].'),
(87,'LL03-064',NULL,0,54,'【ライブ成功時】これがあなたの最初の《ライブ》なら、カードを１枚引く。','[Live Success] If this is your first ⟪LIVE⟫, draw one card.'),
(88,'LL03-065',NULL,0,55,'【ライブ参加時】この《ライブ》にすべて同じ名前のメンバーが参加するか、この《ライブ》に名前が異なるメンバーが５人以上参加するなら、この《ライブ》に参加するメンバー１人に＋【オール】【オール】【オール】する。','[Live Join] If all Members joining this ⟪LIVE⟫ have the same name, or there are five or more differently named Members joining this Live, one Member joining this Live gains +[ALL][ALL][ALL].'),
