(114,'LL04-048',NULL,0,82,'【登場時】手札１枚を裏向きでデッキの１番下に置いてよい。そうしたら、カードを２枚引くか、手札からメンバー１人を《登場》する。','[Entry] You may return one card from your Hand to the bottom of your Deck. If you do, either draw two cards or ⟪ENTER⟫ one Member from your Hand.'),
(115,'LL04-049',NULL,0,83,'【登場時】あなたはデッキの１番上のカードを見る。次にターンを行うあいてはそれが【☆】を持つか持たないかを答える。答えが合っていたなら、それを全員に見せて手札に加え、カードを１枚引く。違っていたなら、そのメンバーを《登場》する。','[Entry] Look at the top card of your Deck. The next player in turn order must guess whether it has Stars or not. If they guess correctly, show the card to everyone, add it to your Hand and draw one card. If they guess incorrectly, ⟪ENTER⟫ that Member.'),
(116,'LL04-050',NULL,0,84,'【登場時】あなたのデッキの上からカード４枚を全員に見せて、その中にいるライブ衣装で【☆】を持たないメンバーから、１人を《登場》して１人を手札に加える。その後、残りのカードを裏向きにしてよく混ぜてデッキの１番下に置く。（１人しかいなくても《登場》できる。）','[Entry] Look at the top four cards of your Deck, and from the Members without Stars and with a Live Costume, pick one to ⟪ENTER⟫ and one to add to your Hand. Then, shuffle the other cards and return them to the bottom of your Deck. (If there is only one Member meeting the conditions, ⟪ENTER⟫ them.)'),
(117,'LL04-051',NULL,0,85,'【登場時】手札から【☆】を持たないメンバーを３人まで《登場》してよい。これでメンバーを１人以上《登場》したなら、次のあなたのターンを１回休む。','[Entry] You may ⟪ENTER⟫ up to three Members without Stars from your Hand. If you ⟪ENTER⟫ at least one Member this way, skip your next turn.'),
(118,'LL04-052',NULL,0,86,'【登場時】あなたはカードを３枚引く。すべてのあいてはカードを１枚引く。','[Entry] Draw three cards. All other players draw one card.'),
