(120,'LL04-054',NULL,0,87,'【登場時】あなたのデッキの１番上のカードを《登場》してよい。そのメンバーが【☆】を２個以上持つなら、このメンバーを裏向きでデッキの１番下に置く。（デッキから《登場》したメンバーの【登場時】より先にデッキの１番下に置く。）','[Entry] You may ⟪ENTER⟫ the top card of your Deck. If you do and that Member has two or more Stars, return this Member to the bottom of your Deck. (Return this Member to the Deck before resolving any [Entry] Skills.)'),
(121,'LL04-055',NULL,0,88,'【ライブ参加時】この《ライブ》に参加する、ライブ衣装が「{{costume:君のこころは輝いてるかい？}}」のメンバー全員に＋【オール】する。','[Live Join] All Members with the \"{{costume:Kimi no Kokoro wa Kagayaiteru kai?}}\" Live Costume joining this ⟪LIVE⟫ gain +[ALL].'),
