(151,'LL05-050',NULL,0,105,'【登場時】あなたのほかの待機中のライブ衣装でないメンバー１人を手札に戻してよい。そうしたら、カードを２枚引く。その後、戻したメンバーと同じ名前の、ライブ衣装のメンバー１人を手札から《登場》してよい。','[Entry] You may return one of your other Members on Stand-By without a Live Costume to your Hand. If you do, draw two cards. After that, you may ⟪ENTER⟫ one Member with a Live Costume and the same name as the Member you returned.'),
(152,'LL05-051',NULL,0,106,'【登場時】あなたのほかの待機中のメンバー１人を裏向きでデッキの１番下に置いてよい。そうしたら、カードを３枚引く。','[Entry] You may return one of your other Members on Stand-By to the bottom of your Deck. If you do, draw three cards.'),
(153,'LL05-051',NULL,1,107,'【ライブ参加時】あなたの手札が３枚以上あるなら、＋【青】する。','[Live Join] If you have three or more cards in your Hand, gain +[COOL].'),
(154,'LL05-052',NULL,0,108,'【登場時】【RUSH】によって《登場》したなら、デッキの１番上のカードを《登場》する。','[Entry] If this Member was ⟪ENTER⟫ed using [RUSH], ⟪ENTER⟫ the top card of your Deck.'),
(155,'LL05-052',NULL,1,28,'【ライブ参加時】あなたのライブ中の楽曲カードが２枚以上あるなら、＋【赤】する。（このメンバーが参加する《ライブ》は枚数に含めない。）','[Live Join] If you already performed two or more Lives, gain +[SMILE]. (The ⟪LIVE⟫ this Member is joining does not count.)'),
(156,'LL05-053',NULL,0,109,'【ライブ参加時】この《ライブ》に、【赤】を持つメンバーと、【緑】を持つメンバーと、【青】を持つメンバーと、【オール】を持つメンバーが参加するなら、＋【オール】する。（それぞれ１人ずつ必要で、このメンバーを含めてもよい。）','[Live Join] If there is a Member with [SMILE], a Member with [PURE], a Member with [COOL] and a Member with [ALL] joining this ⟪LIVE⟫, gain +[ALL]. (You need a seperate Member card for each. You may count this Member.)'),
(157,'LL05-054',NULL,0,110,'【登場時】あなたのデッキの１番上か１番下のカードを全員に見せる。そのメンバーが【☆】を持つなら、それを《登場》する。そうでないなら、それを手札に加え、カードを１枚引く。','[Entry] Show the top or bottom card of your Deck to everyone. If that Member has Stars, ⟪ENTER⟫ them. If not, add them to your Hand and draw one card.'),
(158,'LL05-055',NULL,0,242,'いつものセカイが　あたらしい扉を','Itsumo no sekai ga atarashii tobira o'),
(159,'LL05-055',NULL,1,243,'（もっと）　隠してるの','(Motto) Kakushiteru no'),
(160,'LL05-055',NULL,2,244,'（Let\'s go!）　ぜんぶ開けたいよ　ほら、いっしょにね！','(Let\'s go!) Zenbu aketai yo hora, issho ni ne!'),
(161,'LL05-056',NULL,0,45,'【ライブ中】この《ライブ》に参加している全員が『２年生』で、名前が異なるメンバーが３人以上参加しているなら、♪ライブP＋１♪する。','[While Live] If there are three or more differently named Members joining this ⟪LIVE⟫, and all of them are \"2nd Year\" cards, gain ♪Live Points +1♪.'),
(162,'LL05-057',NULL,0,111,'【ライブ中】この《ライブ》に参加しているメンバーがちょうど３人なら、♪ライブP＋１♪する。','[While Live] If there are exactly three Members joining this ⟪LIVE⟫, gain ♪Live Points +1♪.'),
(163,'LL05-058',NULL,0,245,'ユメを語る言葉より　ユメを語る歌にしよう','Yume o kataru kotoba yori yume o kataru uta ni shiyou'),
(164,'LL05-058',NULL,1,246,'それならば今を伝えられる気がするから','Sore naraba ima mo tsutaerareru ki ga suru kara'),
(165,'LL05-059',NULL,0,112,'【ライブ成功時】あなたとすべてのあいては自分のステージにいる名前が異なるメンバーを数える。それがもっとも少なかった人が１人なら、その人はカードを２枚引く。','[Live Success] You and all other players count the number of differently named Members on their Stages. If there are no ties for the lowest number, the player with the least draws two cards.'),
(166,'LL05-060',NULL,0,45,'【ライブ中】この《ライブ》に参加している全員が『１年生』で、名前が異なるメンバーが３人以上参加しているなら、♪ライブP＋１♪する。','[While Live] If there are three or more differently named Members joining this ⟪LIVE⟫, and all of them are \"1st Year\" cards, gain ♪Live Points +1♪.'),
(167,'LL05-061',NULL,0,45,'【ライブ中】この《ライブ》に参加している全員が『３年生』で、名前が異なるメンバーが３人以上参加しているなら、♪ライブP＋１♪する。','[While Live] If there are three or more differently named Members joining this ⟪LIVE⟫, and all of them are \"3rd Year\" cards, gain ♪Live Points +1♪.'),
(168,'LL05-062',NULL,0,247,'想いよひとつになれ','Omoi yo hitotsu ni nare'),
(169,'LL05-062',NULL,1,248,'どこにいても同じ明日を信じてる','Doko ni itte mo onaji ashita o shinjiteru'),
(170,'LL05-063',NULL,0,113,'【ライブ成功時】この《ライブ》に参加している全員が「Aqours」のメンバーなら、もう１回ターンを行う。','[Live Success] If all Members who joined this ⟪LIVE⟫ are \"Aqours\" cards, take another turn.'),
(171,'LL06-028',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「千歌」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Chika\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(172,'LL06-029',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「梨子」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Riko\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(173,'LL06-030',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「果南」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Kanan\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(174,'LL06-031',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「ダイヤ」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Dia\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(175,'LL06-032',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「曜」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"You\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(176,'LL06-033',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「善子」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Yoshiko\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(177,'LL06-034',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「花丸」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Hanamaru\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(178,'LL06-035',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「鞠莉」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Mari\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(179,'LL06-036',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「ルビィ」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Ruby\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(180,'LL06-037',NULL,0,61,'【ライブ参加時】この《ライブ》に「曜」と「ルビィ」が２人とも参加するなら、＋【緑】【青】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with both \"You\" and \"Ruby\", gain +[PURE][COOL].'),
(181,'LL06-038',NULL,0,61,'【ライブ参加時】この《ライブ》に「善子」と「鞠莉」が２人とも参加するなら、＋【赤】【緑】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with both \"Yoshiko\" and \"Mari\", gain +[SMILE][PURE].'),
(182,'LL06-039',NULL,0,61,'【ライブ参加時】この《ライブ》に「ダイヤ」と「花丸」が２人とも参加するなら、＋【青】【赤】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with both \"Dia\" and \"Hanamaru\", gain +[COOL][SMILE].'),
(183,'LL06-040',NULL,0,61,'【ライブ参加時】この《ライブ》に「果南」と「花丸」が２人とも参加するなら、＋【赤】【緑】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with both \"Kanan\" and \"Hanamaru\", gain +[SMILE][PURE].'),
(184,'LL06-041',NULL,0,61,'【ライブ参加時】この《ライブ》に「千歌」と「ルビィ」が２人とも参加するなら、＋【青】【赤】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with both \"Chika\" and \"Ruby\", gain +[COOL][SMILE].'),
(185,'LL06-042',NULL,0,61,'【ライブ参加時】この《ライブ》に「梨子」と「鞠莉」が２人とも参加するなら、＋【赤】【緑】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with both \"Riko\" and \"Mari\", gain +[SMILE][PURE].'),
(186,'LL06-043',NULL,0,61,'【ライブ参加時】この《ライブ》に「果南」と「ダイヤ」が２人とも参加するなら、＋【緑】【青】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with both \"Kanan\" and \"Dia\", gain +[PURE][COOL].'),
(187,'LL06-044',NULL,0,61,'【ライブ参加時】この《ライブ》に「梨子」と「善子」が２人とも参加するなら、＋【緑】【青】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with both \"Riko\" and \"Yoshiko\", gain +[PURE][COOL].'),
(188,'LL06-045',NULL,0,61,'【ライブ参加時】この《ライブ》に「千歌」と「曜」が２人とも参加するなら、＋【青】【赤】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with both \"Chika\" and \"You\", gain +[COOL][SMILE].'),
(189,'LL06-046',NULL,0,115,'【登場時】あなたは手札にある「千歌」のカード２枚を全員に見せて好きな順番で裏向きでデッキの１番下に置いてよい。そうしたら、デッキの１番上のカードを《登場》する。','[Entry] You may show two \"Chika\" cards from your Hand to everyone, and then return them to the bottom of your Deck in any order. If you do, ⟪ENTER⟫ the top card of your Deck.'),
(190,'LL06-047',NULL,0,116,'【登場時】あなたのステージにいるメンバーがすべて「梨子」で、あなたのセットリストにある表向きの楽曲カードが２色以上あるなら、もう１回ターンを行う。','[Entry] If all Members on your Stage are \"Riko\" cards and the face-up Song cards in your Set List have two or more different Attributes, take another turn.'),
(191,'LL06-048',NULL,0,117,'【登場時】あなたのデッキの上からカード３枚を全員に見せる。その中からメンバー１人を手札に加えて、残りのカードを好きな順番で裏向きでデッキの１番下に置く。下に置いたのがすべて「果南」なら、手札から【LIVE】を持つ「果南」１人を《登場》してよい。','[Entry] Show the top three cards of your Deck to everyone, and pick one from them to add to your Hand. Then, return the rest to the bottom of your Deck in any order. If all of the returned cards are \"Kanan\" cards, you may ⟪ENTER⟫ a \"Kanan\" card with [LIVE] from your Hand.'),
(192,'LL06-049',NULL,0,118,'【ライブ参加時】手札から《登場》し、自身の【LIVE】によって《ライブ》して、それに参加しているメンバーがすべて「ダイヤ」なら、＋【青】する。','[Live Join] If this Member was ⟪ENTER⟫ed from your Hand, joins a ⟪LIVE⟫ using their own [LIVE], and all Members joining this ⟪LIVE⟫ are \"Dia\" cards, gain +[COOL].'),
(193,'LL06-050',NULL,0,119,'【登場時】あなたの待機中のメンバーがすべて「曜」なら、カードを２枚引く。さらに待機中の「曜」のライブ衣装が３種類以上あるなら、このメンバーを参加させて《ライブ》してよい。','[Entry] If all your Members on Stand-By are \"You\" cards, draw two cards. Then, if your \"You\" cards on Stand-By have three or more different Live Costumes, you may perform a ⟪LIVE⟫ with this Member.'),
(194,'LL06-051',NULL,0,120,'【登場時】このゲームであなたがターンを休んでいたなら、このメンバーを参加させて《ライブ》してよい。ターンを休んでいないなら、カードを３枚引く。','[Entry] If you had to skip a turn in this match, you may perform a ⟪LIVE⟫ with this Member. If you haven\'t skipped any turns, draw three cards.'),
(195,'LL06-051',NULL,1,121,'【ライブ参加時】この《ライブ》に参加するメンバーが４人以上で、すべて「善子」なら、＋【青】する。','[Live Join] If there are four or more Members joining this ⟪LIVE⟫ and all of them are \"Yoshiko\" cards, gain +[COOL].'),
(196,'LL06-052',NULL,0,122,'【ライブ参加時】この《ライブ》に参加するメンバーがすべて「花丸」なら、参加するほかのメンバーの【赤】と【緑】と【青】のピースをすべて【オール】にする。','[Live Join] If all of the Members joining this ⟪LIVE⟫ are \"Hanamaru\" cards, treat the [SMILE][PURE][COOL] of all other Members joining this ⟪LIVE⟫ as [ALL].'),
(197,'LL06-053',NULL,0,123,'【登場時】あなたのデッキの１番上のカードを表向きにする。表向きにしたメンバーが「鞠莉」なら、《勧誘》する。','[Entry] Flip the top card of your Deck. If that Member is a \"Mari\" card, ⟪SCOUT⟫.'),
(198,'LL06-053',NULL,1,124,'【ライブ参加時】あなたは手札にある「鞠莉」のカード１枚を全員に見せてよい。そうしたら、＋【赤】か＋【緑】か＋【青】する。（その後、見せたカードを手札に戻す。）','[Live Join] You may show one \"Mari\" card from your Hand to everyone. If you do, gain either +[SMILE], +[PURE] or +[COOL]. (Return the card to your Hand after this.)'),
(199,'LL06-054',NULL,0,125,'【登場時】デッキから《登場》したなら、カードを２枚引く。「ルビィ」のスキルによってデッキから《登場》したなら、さらに手札からメンバー１人を《登場》する。','[Entry] If this Member was ⟪ENTER⟫ed from your Deck, draw two cards. If this Member was ⟪ENTER⟫ed from your Deck with a Skill from a \"Ruby\" card, ⟪ENTER⟫ one Member from your Hand.'),
(200,'LL06-055',NULL,0,52,'【ライブ中】この《ライブ》に参加している全員が「CYaRon！」のメンバー（「千歌」「曜」「ルビィ」）で、３人全員がそろって参加しているなら、♪ライブP＋１♪する。','[While Live] If all Members joining this ⟪LIVE⟫ are part of \"CYaRon!\" (\"Chika\", \"You\" and \"Ruby\"), and all three are joining, gain ♪Live Points +1♪.'),
(201,'LL06-056',NULL,0,52,'【ライブ中】この《ライブ》に参加している全員が「AZALEA」のメンバー（「果南」「ダイヤ」「花丸」）で、３人全員がそろって参加しているなら、♪ライブP＋１♪する。','[While Live] If all Members joining this ⟪LIVE⟫ are part of \"AZALEA\" (\"Kanan\", \"Dia\" and \"Hanamaru\"), and all three are joining, gain ♪Live Points +1♪.'),
(202,'LL06-057',NULL,0,52,'【ライブ中】この《ライブ》に参加している全員が「Guilty Kiss」のメンバー（「梨子」「善子」「鞠莉」）で、３人全員がそろって参加しているなら、♪ライブP＋１♪する。','[While Live] If all Members joining this ⟪LIVE⟫ are part of \"Guilty Kiss\" (\"Riko\", \"Yoshiko\" and \"Mari\"), and all three are joining, gain ♪Live Points +1♪.'),
(203,'LL06-058',NULL,0,126,'【ライブ成功時】この《ライブ》に参加している中で、カードが１番少ないメンバー１人を選び、それと同じ名前の、【☆】を持たないメンバーを２人まで手札から《登場》してよい。','[Live Success] From all differently named Members who joined this ⟪LIVE⟫, pick one that has the lowest number of cards in this ⟪LIVE⟫, then ⟪ENTER⟫ up to two Members with the same name and without Stars from your Hand.'),
(204,'LL06-059',NULL,0,127,'【ライブ参加時】ゲームの準備でターンを行う順番を決めたときにあなたが１番最後だったなら、通常スコアが【１１１】になる。','[Live Join] If you were last in the turn order when it was decided during setup, the Attribute Piece requirement changes to [111].'),
