(209,'LL06-062',NULL,0,129,'【ライブ参加時】あなたの手札が４枚以上あるなら、共通スコアが２減る。','[Live Join] If you have four or more cards in your Hand, the Any Piece requirement is reduced by 2.'),
(210,'LL06-063',NULL,0,130,'【ライブ参加時】あなたのセットリストにある裏向きのカードが７枚以上あるなら、共通スコアが４減る。','[Live Join] If there are seven or more face-down Song cards in your Set List, the Any Piece requirement is reduced by 4.'),
