(224,'LL07-043',NULL,0,304,'【登場時】あなたの待機中のメンバーに「果南」か「ダイヤ」がいるなら、カードを１枚引く。','[Entry] If there is a \"Kanan\" or \"Dia\" card on Stand-By on your Stage, draw one card.'),
(225,'LL07-044',NULL,0,304,'【登場時】あなたの待機中のメンバーに「梨子」か「善子」がいるなら、カードを１枚引く。','[Entry] If there is a \"Riko\" or \"Yoshiko\" card on Stand-By on your Stage, draw one card.'),
(226,'LL07-045',NULL,0,304,'【登場時】あなたの待機中のメンバーに「千歌」か「曜」がいるなら、カードを１枚引く。','[Entry] If there is a \"Chika\" or \"You\" card on Stand-By on your Stage, draw one card.'),
(227,'LL07-046',NULL,0,305,'【登場時】あなたのデッキの上からカード３枚を全員に見せる。その中から【☆】を持つメンバー１人を手札に加えて、残りのカードを好きな順番で裏向きでデッキの１番下に置く。【☆】を持たないメンバー３人を見せたなら、もう１回ターンを行う。','[Entry] Show the top three cards of your Deck to everyone, and pick one Member with Stars from them to add to your Hand. Then, return the rest to the bottom of your Deck in any order. If you have shown three cards without Stars, take another turn.'),
(228,'LL07-047',NULL,0,306,'【登場時】あなたのセットリストにある表向きの楽曲カードが２色以上あるなら、１色につき、カードを１枚引く。すべて同じ色なら、あなたのセットリストにある裏向きのカード１枚を表向きにする。','[Entry] If the face-up Song cards in your Set List have two or more different Attributes, draw one card for each different Attribute. If all your face-up Song cards have the same Attribute, flip one face-down Song card in your Set List face-up.'),
(229,'LL07-048',NULL,0,307,'【登場時】手札から【☆】を持たないメンバー１人を《登場》してよい。そうしたら、手札からそのメンバーと全く同じピースを持ち、名前が異なるメンバー１人を《登場》してよい。','[Entry] You may ⟪ENTER⟫ one Member without Stars from your Hand. If you do, you may ⟪ENTER⟫ another Member with exactly the same Pieces but a different name from your Hand.'),
(230,'LL07-049',NULL,0,308,'【登場時】カードを２枚引く。その後、次にターンを行うあいては『みんなでカードを引く』ことを選んでよい。そうしたら、あなたとすべてのあいてはカードを１枚引く。','[Entry] Draw two cards. After that, the next player in turn order may choose to let everyone draw cards. If they choose to do so, you and the other players draw one card each.'),
(231,'LL07-050',NULL,0,309,'【登場時】手札１枚を裏向きでデッキの１番下に置いてよい。そうしたら、デッキの上からカードを２枚見て、その中からメンバー１人を《登場》し、残りのカードを裏向きでデッキの１番下に置く。','[Entry] You may return one card from your Hand to the bottom of your Deck. If you do, look at the top two cards of your Deck, ⟪ENTER⟫ one of them, then return the other to the bottom of your Deck.'),
(232,'LL07-051',NULL,0,310,'【登場時】手札２枚を好きな順番で裏向きでデッキの１番下に置いてよい。そうしたら、カードを２枚引くか、このメンバーを参加させて《ライブ》してよい。','[Entry] You may return two cards from your Hand to the bottom of your Deck in any order. If you do, you may either draw two cards or perform a ⟪LIVE⟫ with this Member.'),
(233,'LL07-052',NULL,0,311,'【ライブ参加時】あなたの手札がどのあいてよりも多いなら、＋【オール】する。そうでないなら、カードを１枚引く。','[Live Join] If you have more cards in your Hand than any of the other players, gain +[ALL]. Otherwise, draw one card.'),
(234,'LL07-053',NULL,0,312,'【登場時】手札から【オール】を持つメンバー１人を《登場》してよい。《登場》したメンバーが【オール】を３個以上持つなら、カードを３枚引く。','[Entry] You may ⟪ENTER⟫ one Member with [ALL] from your Hand. If the ⟪ENTER⟫ed Member has three or more [ALL], draw three cards.'),
(235,'LL07-054',NULL,0,313,'【ライブ参加時】この《ライブ》に、ほかの【☆】を２個持つメンバーと、【☆】を１個持つメンバーと、【☆】を持たないメンバーが参加するなら、＋【オール】し、カードを１枚引く。','[Live Join] If there is another Member with 2 Stars, a Member with 1 Star and a Member with no Stars joining this ⟪LIVE⟫, gain +[ALL] and draw one card.'),
(236,'LL07-055',NULL,0,314,'【ライブ成功時】この《ライブ》に「CYaRon！」のメンバー（「千歌」「曜」「ルビィ」）が３人全員そろって参加しているなら、待機中の「CYaRon！」のメンバーのみを参加させて《ライブ》してよい。','[Live Success] If all three members of \"CYaRon!\" (\"Chika\", \"You\" and \"Ruby\") joined this ⟪LIVE⟫, you may perform a ⟪LIVE⟫ with only \"CYaRon!\" Members on Stand-By.'),
(237,'LL07-056',NULL,0,315,'【ライブ中】この《ライブ》に「AZALEA」のメンバー（「果南」「ダイヤ」「花丸」）が３人全員そろって参加しているなら、♪ライブP＋１♪し、あなたの《ライブ》に参加するメンバーの【赤】と【緑】と【青】のピースをすべて【オール】にする。','[While Live] If all three members of \"AZALEA\" (\"Kanan\", \"Dia\" and \"Hanamaru\") joined this ⟪LIVE⟫, gain ♪Live Points +1♪ and treat the [SMILE][PURE][COOL] of all Members joining your ⟪LIVE⟫s as [ALL].'),
(238,'LL07-057',NULL,0,316,'【ライブ成功時】この《ライブ》に「Guilty Kiss」のメンバー（「梨子」「善子」「鞠莉」）が３人全員そろって参加しているなら、手札から【☆】を持たない「Guilty Kiss」のメンバーをそれぞれ１人まで《登場》してよい。','[Live Success] If all three members of \"Guilty Kiss\" (\"Riko\", \"Yoshiko\" and \"Mari\") joined this ⟪LIVE⟫, you may ⟪ENTER⟫ one Member without Stars of each member of \"Guilty Kiss\" from your Hand.'),
(239,'LL07-058',NULL,0,317,'【ライブ参加時】あなたのステージに「千歌」「梨子」「果南」「ダイヤ」「曜」「善子」「花丸」「鞠莉」「ルビィ」がいるなら、通常スコアが【２３２】になる。','[Live Join] If \"Chika\", \"Riko\", \"Kanan\", \"Dia\", \"You\", \"Yoshiko\", \"Hanamaru\", \"Mari\" and \"Ruby\" are all on your Stage, the Attribute Piece requirement changes to [232].'),
(240,'LL07-059',NULL,0,47,'【ライブ中】全員の目標ライブＰを＋１する。（もともとの目標ライブＰが９点なら、１０点になる。）','[While Live] Increase each player\'s Live Points goal by 1. (If you are using the recommended goal of 9 Live Points, you are now playing to 10 Live Points.)'),
