(246,'LL07-062',NULL,0,318,'【ライブ参加時】あなたのステージにいる、ライブ衣装が「{{costume:想いよひとつになれ}}」の名前が異なるメンバー１人につき、共通スコアが１減る。','[Live Join] For each differently named Member on your Stage with the \"{{costume:Omoi yo Hitotsu ni Nare}}\" Live Costume, the Any Piece requirement is reduced by 1.'),
