(275,'LL08-046',NULL,0,410,'【登場時】『カードを２枚引く。』か『このメンバーを参加させて《ライブ》してよい。』のどちらかを行う。あなたのライブPが３点以上なら、どちらも行う。（どちらも行うなら、先にカードを引く。）','[Entry] Do either, or do both if you have 3 or more Live Points: ① Draw two cards. ② You may perform a ⟪LIVE⟫ with this Member. (If you do both, do ① first.)'),
(276,'LL08-047',NULL,0,411,'【登場時】あなたのセットリストにある表向きの楽曲カードの色１つにつき、カードを１枚引く。その後、手札から【☆】を持たないメンバー１人を《登場》してよい。','[Entry] For each different Attribute of the face-up Song cards in your Set List, draw one card. Then, you may ⟪ENTER⟫ one Member without Stars from your Hand.'),
(277,'LL08-048',NULL,0,412,'【ライブ成功時】あなたのライブ中のメンバーが３人以上いるなら、カードを１枚引く。あなたのライブ中のメンバーが９人以上いるなら、さらに手札から【☆】を持たないメンバー１人を《登場》してよい。（この《ライブ》に参加しているメンバーも人数に含める。）','[Live Success] If there are three or more Members currently in your Lives, draw one card. If there are nine or more Members currently in your Lives, you may ⟪ENTER⟫ one Member without Stars from your Hand. (Members who joined this ⟪LIVE⟫ are also counted.)'),
(278,'LL08-049',NULL,0,413,'【登場時】ターンを行う順番ですべてのあいてはそれぞれ『ダイヤちゃん』と呼んでよい。すべてのあいてが『ダイヤちゃん』と呼んだなら、あなたは手札から【☆】を持たないメンバー１人を《登場》してよい。そうでないなら、あなたはデッキの１番上のカードを《登場》する。','[Entry] In turn order, each player may call Dia \"Dia-chan\". If everyone calls her \"Dia-chan\", you may ⟪ENTER⟫ one Member without Stars from your Hand. If not, ⟪ENTER⟫ the top card of your Deck.'),
(279,'LL08-050',NULL,0,414,'【ライブ参加時】この《ライブ》に参加する【緑】を持つメンバー１人に＋【緑】する。','[Live Join] One Member joining this ⟪LIVE⟫ with [PURE] gains +[PURE].'),
(280,'LL08-051',NULL,0,415,'【登場時】次にターンを行うあいてとじゃんけんをする。（あいこなら繰り返す。）あなたが勝ったなら、もう１回ターンを行う。あなたが負けたなら、手札３枚を好きな順番で裏向きでデッキの１番下に置くことで、じゃんけんに勝ったことにしてよい。','[Entry] Play rock-paper-scissors with the next player in turn order. (Repeat if tied.) If you win, take another turn. If not, you may still treat the loss as a win if you return three cards from your Hand to the bottom of your Deck.'),
(281,'LL08-052',NULL,0,416,'【ライブ参加時】あなたの手札にカードが無いか、あなたのライブ中の楽曲カードが無いなら、＋【赤】する。','[Live Join] If you have no cards in your Hand or there are no Song cards that are Live on your Stage, gain +[SMILE].'),
(282,'LL08-053',NULL,0,417,'【登場時】次にターンを行うあいては、自分のセットリストにある表向きの楽曲カード１枚を裏向きにしてほかの裏向きのカードとよく混ぜてよい。そうしなかったら、あなたのセットリストにある裏向きのカード１枚を表向きにする。','[Entry] The next player in turn order may flip one face-up Song card in their Set List face-down and shuffle it with their other face-down cards. If they do not, flip one face-down Song card from your Set List face-up.'),
(283,'LL08-054',NULL,0,418,'【登場時】カードを１枚引く。あなたのステージにいるメンバーのライブ衣装が３種類以上あるなら、さらにカードを１枚引く。','[Entry] Draw one card. If the Members on your Stage have three or more different Live Costumes, draw another card.'),
(284,'LL08-055',NULL,0,419,'【ライブ成功時】これがあなたの最初の《ライブ》なら、カードを３枚引く。そうでないなら、カードを２枚引く。','[Live Success] If this is your first ⟪LIVE⟫, draw three cards. If not, draw two cards.'),
(285,'LL08-056',NULL,0,420,'【ライブ参加時】この《ライブ》にあなたの待機中のメンバー全員が参加するなら、通常スコアが【３２３】になる。','[Live Join] If all of your Members on Stand-By are joining this ⟪LIVE⟫, the Attribute Piece requirement changes to [323].'),
(286,'LL08-057',NULL,0,421,'【ライブ参加時】この《ライブ》に「梨子」と「花丸」と「鞠莉」がちょうど３人で参加するなら、この《ライブ》に参加するメンバー全員に＋【オール】する。','[Live Join] If exactly three Members, \"Riko\", \"Hanamaru\" and \"Mari\", are joining this ⟪LIVE⟫, all Members joining this ⟪LIVE⟫ gain +[ALL].'),
(287,'LL08-058',NULL,0,144,'【ライブ参加時】この《ライブ》に【赤】を持つ「ダイヤ」と【赤】を持つ「ルビィ」が参加するなら、共通スコアが３減る。','[Live Join] If a \"Dia\" card with [SMILE] and a \"Ruby\" card with [SMILE] are joining this ⟪LIVE⟫, the Any Piece requirement is reduced by 3.'),
(288,'LL08-059',NULL,0,422,'【ライブ参加時】この《ライブ》にライブ衣装の「曜」とライブ衣装の「善子」が参加するなら、共通スコアが３減る。','[Live Join] If a \"You\" card with a Live Costume and a \"Yoshiko\" card with a Live Costume are joining this ⟪LIVE⟫, the Any Piece requirement is reduced by 3.'),
(289,'LL08-060',NULL,0,423,'【ライブ参加時】この《ライブ》に【RUSH】か【LIVE】を持つ「千歌」と【RUSH】か【LIVE】を持つ「果南」が参加するなら、共通スコアが３減る。','[Live Join] If a \"Chika\" card with [RUSH] or [LIVE] and a \"Kanan\" card with [RUSH] or [LIVE] are joining this ⟪LIVE⟫, the Any Piece requirement is reduced by 3.'),
