(322,'LL09-045',NULL,0,322,'【登場時】このターンにほかのメンバーが《登場》していたなら、カードを２枚引く。','[Entry] If another Member was ⟪ENTER⟫ed this turn, draw two cards.'),
(323,'LL09-046',NULL,0,424,'【登場時】あなたの手札とライブ中の楽曲カードが０枚でなく、あなたのほかの待機中のメンバーが０人でないなら、デッキの１番上のカードを《登場》する。','[Entry] If you have at least one card in your Hand, there is at least one Song card that is Live on your Stage, and there is at least one other Member on Stand-By on your Stage, ⟪ENTER⟫ the top card of your Deck.'),
(324,'LL09-047',NULL,0,303,'【ライブ参加時】あなたのセットリストにある裏向きのカードが４枚以上あるなら、＋【青】する。７枚以上あるなら、さらに＋【青】する。','[Live Join] If there are four or more face-down Song cards in your Set List, gain +[COOL]. If there are seven or more, gain another +[COOL].'),
(325,'LL09-048',NULL,0,425,'【登場時】あなたの待機中の【☆】を持たないメンバー１人を裏向きでデッキの１番下に置いてよい。そうしたら、あなたのコレクションから、そのメンバーと同じ名前の【☆】を１個持つメンバー１人を《登場》してよい。','[Entry] You may return one Member on Stand-By without Stars from your Stage to the bottom of your Deck. If you do, you may ⟪ENTER⟫ one Member with the same name as that Member with one Star from your Collection.'),
(326,'LL09-049',NULL,0,426,'【ライブ参加時】この《ライブ》に【☆】を１個持つメンバーが２人以上参加するなら、＋【オール】【オール】する。','[Live Join] If two or more Members with one Star are joining this ⟪LIVE⟫, gain +[ALL][ALL].'),
(327,'LL09-050',NULL,0,427,'【登場時】手札から、あなたのセットリストにある表向きの楽曲カードと同名のライブ衣装で、【☆】を持たないメンバー１人を《登場》してよい。そうしたら、その楽曲カードをこのメンバーと《登場》したメンバーを参加させて《ライブ》してよい。','[Entry] You may enter one Member that has a Live Costume with the same name as one of the face-up Song cards in your Set List from your Hand. If you do, you may perform a ⟪LIVE⟫ with that Song card, this Member and the ⟪ENTER⟫ed Member.'),
(328,'LL09-051',NULL,0,428,'【登場時】あなたのデッキの１番上のカードを表向きにする。表向きにしたメンバーが持つピースが１種類なら、そのメンバーを手札に加え、カードを２枚引く。２種類なら、手札からメンバー１人を《登場》してよい。３種類以上なら、どちらも行う。','[Entry] Flip the top card of your Deck. If that Member\'s Pieces have only one type of Attribute, add that Member to your Hand and draw two cards. If they have two types of Attributes, you may ⟪ENTER⟫ one Member from your Hand. If they have three or more types of Attributes, do both.'),
(329,'LL09-052',NULL,0,429,'【登場時】前のターンにあいてが《ライブ》していたなら、このメンバーを参加させて《ライブ》してよい。','[Entry] If another player performed a ⟪LIVE⟫ in the previous turn, you may perform a ⟪LIVE⟫ with this Member.'),
(330,'LL09-053',NULL,0,430,'【登場時】手札から【☆】を持つメンバーを３人まで《登場》してよい。それらのメンバーの【RUSH】、【LIVE】、【登場時】スキルは何もしない。','[Entry] You may ⟪ENTER⟫ up to three Members with Stars from your Hand. Do not use their [RUSH], [LIVE] or [Entry] Skill.'),
(331,'LL09-054',NULL,0,431,'【登場時】『次にターンを行うあいての手札が５枚以上あるなら、カードを４枚引く。』か『手札から【☆】を持たないメンバー１人を《登場》する。』のどちらかを行う。','[Entry] Do either: ① If the next player in turn order has five or more cards in their Hand, draw four cards. ② ⟪ENTER⟫ one Member without Stars from your Hand.'),
(332,'LL09-055',NULL,0,288,'約束したい　祈って頑張って','Yakusoku shitai inotte ganbatte'),
(333,'LL09-055',NULL,1,289,'叶えたい夢に出会えた喜びずっと大事にするよ','Kanaetai yume ni deaeta yorokobi zutto daiji ni suru yo'),
(334,'LL09-056',NULL,0,440,'【ライブ参加時】この《ライブ》に参加するメンバー全員が同じライブ衣装なら、共通スコアが３減る。','[Live Join] If all Members joining this ⟪LIVE⟫ have the same Live Costume, the Any Piece requirement is reduced by three.'),
(335,'LL09-057',NULL,0,441,'【ライブ参加時】あなたのステージにいるメンバーの名前がすべて同じなら、この《ライブ》に参加するメンバー１人に＋【オール】する。','[Live Join] If all Members on your Stage have the same name, one Member joining this ⟪LIVE⟫ gains +[ALL].'),
(336,'LL09-058',NULL,0,442,'【ライブ中】あなたがほかにスキルを持つ楽曲カードをライブ中でないなら、あなたのほかのライブ中の楽曲カード１枚につき、♪ライブP＋１♪する。','[While Live] If none of the other Song cards that are Live on your Stage have Skills, gain ♪Live Points +1♪ for each Song card that is Live on your Stage.'),
