(342,'LL09-061',NULL,0,443,'【ライブ成功時】この《ライブ》に参加しているメンバー全員が【オール】を持たないなら、もう１回ターンを行う。','[Live Success] If none of the Members who joined this ⟪LIVE⟫ have [ALL], take another turn.'),
(343,'LL09-062',NULL,0,444,'【ライブ参加時】この《ライブ》に参加する全員が「Aqours」のメンバーでそれぞれ名前が異なるなら、参加するメンバー全員に＋【青】する。','[Live Join] If all Members joining this ⟪LIVE⟫ are part of \"Aqours\" and are differently named, all Members joining this ⟪LIVE⟫ gain +[COOL].'),
(344,'LL09-063',NULL,0,445,'【ライブ参加時】この《ライブ》に参加する「Aqours」のメンバーのライブ衣装１種類につき、共通スコアが１減る。','[Live Join] For each different Live Costume the \"Aqours\" Members joining this ⟪LIVE⟫ have, the Any Piece requirement is reduced by 1.'),
(345,'LL10-037',NULL,0,131,'【登場時】手札から【☆】を持たない『２年生』のメンバー１人を《登場》してよい。','[Entry] You may ⟪ENTER⟫ one \"2nd Year\" card without Stars from your Hand.'),
