(351,'LL10-043',NULL,0,131,'【登場時】手札から【☆】を持たない『１年生』のメンバー１人を《登場》してよい。','[Entry] You may ⟪ENTER⟫ one \"1st Year\" card without Stars from your Hand.'),
(352,'LL10-044',NULL,0,131,'【登場時】手札から【☆】を持たない『３年生』のメンバー１人を《登場》してよい。','[Entry] You may ⟪ENTER⟫ one \"3rd Year\" card without Stars from your Hand.'),
(353,'LL10-045',NULL,0,131,'【登場時】手札から【☆】を持たない『１年生』のメンバー１人を《登場》してよい。','[Entry] You may ⟪ENTER⟫ one \"1st Year\" card without Stars from your Hand.'),
(354,'LL10-046',NULL,0,132,'【登場時】あなたのステージにいるメンバーがすべて『２年生』なら、『カードを２枚引く。』か『あなたのセットリストにある裏向きのカード１枚を表向きにする。』か『手札からライブ衣装で【☆】を持たないメンバー１人を《登場》してよい。』のどれかを行う。','[Entry] If all Members on your Stage are \"2nd Year\" cards, either draw two cards, flip one face-down Song card in your Set List face-up or ⟪ENTER⟫ one Member without Stars and with a Live Costume from your Hand.'),
(355,'LL10-047',NULL,0,133,'【登場時】あなたのステージにいるメンバーがすべて「Aqours」のメンバーなら、あなたのコレクションから、スキルを持たない「Aqours」の楽曲カード１枚を表向きでセットリストに置いてよい。','[Entry] If all Members on your Stage are \"Aqours\" cards, you may bring one \"Aqours\" Song card without a Skill from your Collection to your Set List face-up.'),
(356,'LL10-048',NULL,0,134,'【ライブ中】あなたのスキルで『{{skilltext:あなたのライブ中のメンバー}}』の人数を数えるなら、２倍数える。（『あなたのライブ中のメンバー』と書かれているスキルのみ２倍にする。）','[While Live] When resolving any Skill that requires counting \"{{skilltext:Members currently in your Lives}}\", double the amount you counted. (Double the amount only if the Skill text contains \"Members currently in your Lives\" exactly.)'),
(357,'LL10-049',NULL,0,135,'【ライブ参加時】この《ライブ》に【☆】を持つ『３年生』が３人以上参加するなら、＋【オール】する。','[Live Join] If there are three or more \"3rd Year\" cards with Stars joining this ⟪LIVE⟫, gain +[ALL].'),
(358,'LL10-050',NULL,0,136,'【登場時】手札から、あなたのステージにいるメンバーのライブ衣装１種類につき、それと同じライブ衣装で【☆】を持たないメンバー１人を《登場》してよい。','[Entry] For each different Live Costume on your Stage, you may ⟪ENTER⟫ one Member with the same Live Costume and without Stars from your Hand.'),
(359,'LL10-051',NULL,0,137,'【登場時】あなたの待機中のメンバーの人数が偶数なら、カードを１枚引く。奇数なら、デッキの１番上のカードを《登場》する。','[Entry] If there is an even number of Members on Stand-By on your Stage, draw one card. If the number is odd, ⟪ENTER⟫ the top card of your Deck.'),
(360,'LL10-052',NULL,0,138,'【ライブ成功時】この《ライブ》に参加しているメンバー全員が持つピースの合計が、《ライブ》している楽曲カードのスコアより多いなら、カードを２枚引く。','[Live Success] If the total number of Pieces of the Members who joined this ⟪LIVE⟫ is higher than the requirement of the Song card used for this ⟪LIVE⟫, draw two cards.'),
(361,'LL10-053',NULL,0,139,'【ライブ成功時】カードを１枚引く。この《ライブ》に【オール】を持つほかのメンバーが参加しているなら、さらにカードを１枚引く。','[Live Success] Draw one card. If there is another Member with [ALL] who joined this ⟪LIVE⟫, draw another card.'),
(362,'LL10-054',NULL,0,140,'【登場時】あなたのデッキの上からカード３枚を全員に見せて、その中にいる『１年生』のメンバーを２人まで手札に加える。その後、残りのカードを好きな順番で裏向きでデッキの１番下に置く。','[Entry] Show the top three cards of your Deck to everyone, and pick up to two \"1st Year\" Members from them to add to your Hand. Then, return the rest to the bottom of your Deck in any order.'),
(363,'LL10-059',NULL,0,141,'【ライブ参加時】この《ライブ》に「理亞」が参加するなら、＋【青】する。','[Live Join] If a \"Leah\" card is joining this ⟪LIVE⟫, gain +[COOL].'),
(364,'LL10-059',NULL,1,142,'【ライブ参加時】あなたのステージに「Saint Aqours Snow」のメンバー全員がそろっているなら、＋【オール】する。','[Live Join] If every member of \"Saint Aqours Snow\" is on your Stage, gain +[ALL].'),
(365,'LL10-060',NULL,0,141,'【ライブ参加時】この《ライブ》に「聖良」が参加するなら、＋【青】する。','[Live Join] If a \"Sarah\" card is joining this ⟪LIVE⟫, gain +[COOL].'),
(366,'LL10-060',NULL,1,142,'【ライブ参加時】あなたのステージに「Saint Aqours Snow」のメンバー全員がそろっているなら、＋【オール】する。','[Live Join] If every member of \"Saint Aqours Snow\" is on your Stage, gain +[ALL].'),
(367,'LL10-061',NULL,0,143,'【ライブ中】この《ライブ》に、名前が異なる「Saint Snow」のメンバー２人と、名前が異なる「Aqours」のメンバーが２人以上参加しているなら、♪ライブP＋２♪する。','[While Live] If two differently named \"Saint Snow\" Members and two or more differently named \"Aqours\" Members are joining this ⟪LIVE⟫, gain ♪Live Points +2♪.'),
(368,'LL10-062',NULL,0,144,'【ライブ参加時】この《ライブ》に【青】を持つ「聖良」と【青】を持つ「理亞」が参加するなら、共通スコアが２減る。','[Live Join] If a \"Sarah\" card with [COOL] and a \"Leah\" card with [COOL] are joining this ⟪LIVE⟫, the Any Piece requirement is reduced by 2.'),
(369,'LL10-063',NULL,0,145,'【ライブ中】『この《ライブ》に名前が異なるメンバーがちょうど２人参加していて、ピースを合計４個以上持っている。』を満たしていないなら、♪ライブP－１♪する。','[While Live] Exactly two differently named Members must have joined this ⟪LIVE⟫, and they must have four or more Pieces in total. Otherwise, lose ♪Live Points -1♪.'),
(370,'LL10-064',NULL,0,146,'【ライブ参加時】あなたのステージにいるメンバーがすべて「千歌」で、あなたの手札が１枚以上あるなら、共通スコアが４減る。','[Live Join] If all Members on your Stage are \"Chika\" cards and you have one or more cards in your Hand, the Any Piece requirement is reduced by 4.'),
(371,'LL10-065',NULL,0,147,'【ライブ参加時】あなたのステージにいるメンバーがすべて「花丸」で、この《ライブ》に参加するメンバーが同じ種類のピース（【赤】か【緑】か【青】か【オール】）を合計４個以上持つなら、共通スコアが４減る。','[Live Join] If all Members on your Stage are \"Hanamaru\" cards and the Members joining this ⟪LIVE⟫ have four or more of one Piece Attribute ([SMILE], [PURE], [COOL] or [ALL]) in total, the Any Piece requirement is reduced by 4.'),
(372,'LL10-066',NULL,0,148,'【ライブ参加時】あなたのステージにいるメンバーがすべて「善子」で、この《ライブ》に【☆】を持たないメンバーが参加するなら、この《ライブ》に参加する「善子」１人に＋【オール】【オール】【オール】する。','[Live Join] If all Members on your Stage are \"Yoshiko\" cards and there are Members without Stars joining this ⟪LIVE⟫, one \"Yoshiko\" card joining this ⟪LIVE⟫ gains +[ALL][ALL][ALL].'),
(373,'LL10-067',NULL,0,149,'【ライブ参加時】あなたのステージにいるメンバーがすべて「梨子」で、あなたのセットリストにある表向きの楽曲カードと、あなたのライブ中の楽曲カードが合計で３枚以上あるなら、共通スコアが４減る。','[Live Join] If all Members on your Stage are \"Riko\" cards, and you have three or more total face-up Song cards that are in your Set List or Live on your Stage, the Any Piece requirement is reduced by 4.'),
(374,'LL10-068',NULL,0,150,'【ライブ参加時】あなたのステージにいるメンバーがすべて「曜」で、この《ライブ》にライブ衣装のメンバーが３人以上参加するなら、共通スコアが４減る。','[Live Join] If all Members on your Stage are \"You\" cards and there are three or more Members with a Live Costume joining this ⟪LIVE⟫, the Any Piece requirement is reduced by 4.'),
(375,'LL10-069',NULL,0,151,'【ライブ参加時】あなたのステージにいるメンバーがすべて「ルビィ」なら、この《ライブ》に参加する【赤】を持つ「ルビィ」１人に＋【オール】【オール】【オール】する。','[Live Join] If all Members on your Stage are \"Ruby\" cards, one \"Ruby\" card with [SMILE] joining this ⟪LIVE⟫ gains +[ALL][ALL][ALL].'),
(376,'LL10-070',NULL,0,152,'【ライブ参加時】あなたのステージにいるメンバーがすべて「ダイヤ」で、この《ライブ》に【☆】を持つメンバーが２人以上参加するなら、共通スコアが４減る。','[Live Join] If all Members on your Stage are \"Dia\" cards and there are two or more Members with Stars joining this ⟪LIVE⟫, the Any Piece requirement is reduced by 4.'),
