(473,'LL12-037',NULL,0,155,'【登場時】あなたのステージにいる全員が「CYaRon！」のメンバー（「千歌」「曜」「ルビィ」）で、３人全員がそろっているなら、手札からライブ衣装のメンバー１人を《登場》してよい。','[Entry] If all Members on your Stage are part of \"CYaRon!\" (\"Chika\", \"You\" and \"Ruby\") and all three are on your Stage, ⟪ENTER⟫ one Member with a Live Costume from your Hand.'),
(474,'LL12-038',NULL,0,156,'【登場時】あなたのステージにいる全員が「Guilty Kiss」のメンバー（「梨子」「善子」「鞠莉」）で、３人全員がそろっているなら、カードを２枚引き、手札１枚を裏向きでデッキの１番上か１番下に置く。','[Entry] If all Members on your Stage are part of \"Guilty Kiss\" (\"Riko\", \"Yoshiko\" and \"Mari\") and all three are on your Stage, draw two cards, then place one card from your Hand on the top or bottom of your Deck.'),
(475,'LL12-039',NULL,0,157,'【登場時】あなたのステージにいる全員が「AZALEA」のメンバー（「果南」「ダイヤ」「花丸」）で、３人全員がそろっているなら、あなたのコレクションから「AZALEA」の楽曲カード１枚を表向きでセットリストに置いてよい。','[Entry] If all Members on your Stage are part of \"AZALEA\" (\"Kanan\", \"Dia\" and \"Hanamaru\") and all three are on your Stage, you may bring one \"AZALEA\" Song card from your Collection to your Set List face-up.'),
(476,'LL12-040',NULL,0,157,'【登場時】あなたのステージにいる全員が「AZALEA」のメンバー（「果南」「ダイヤ」「花丸」）で、３人全員がそろっているなら、あなたのコレクションから「AZALEA」の楽曲カード１枚を表向きでセットリストに置いてよい。','[Entry] If all Members on your Stage are part of \"AZALEA\" (\"Kanan\", \"Dia\" and \"Hanamaru\") and all three are on your Stage, you may bring one \"AZALEA\" Song card from your Collection to your Set List face-up.'),
(477,'LL12-041',NULL,0,155,'【登場時】あなたのステージにいる全員が「CYaRon！」のメンバー（「千歌」「曜」「ルビィ」）で、３人全員がそろっているなら、手札からライブ衣装のメンバー１人を《登場》してよい。','[Entry] If all Members on your Stage are part of \"CYaRon!\" (\"Chika\", \"You\" and \"Ruby\") and all three are on your Stage, ⟪ENTER⟫ one Member with a Live Costume from your Hand.'),
(478,'LL12-042',NULL,0,156,'【登場時】あなたのステージにいる全員が「Guilty Kiss」のメンバー（「梨子」「善子」「鞠莉」）で、３人全員がそろっているなら、カードを２枚引き、手札１枚を裏向きでデッキの１番上か１番下に置く。','[Entry] If all Members on your Stage are part of \"Guilty Kiss\" (\"Riko\", \"Yoshiko\" and \"Mari\") and all three are on your Stage, draw two cards, then place one card from your Hand on the top or bottom of your Deck.'),
(479,'LL12-043',NULL,0,157,'【登場時】あなたのステージにいる全員が「AZALEA」のメンバー（「果南」「ダイヤ」「花丸」）で、３人全員がそろっているなら、あなたのコレクションから「AZALEA」の楽曲カード１枚を表向きでセットリストに置いてよい。','[Entry] If all Members on your Stage are part of \"AZALEA\" (\"Kanan\", \"Dia\" and \"Hanamaru\") and all three are on your Stage, you may bring one \"AZALEA\" Song card from your Collection to your Set List face-up.'),
(480,'LL12-044',NULL,0,156,'【登場時】あなたのステージにいる全員が「Guilty Kiss」のメンバー（「梨子」「善子」「鞠莉」）で、３人全員がそろっているなら、カードを２枚引き、手札１枚を裏向きでデッキの１番上か１番下に置く。','[Entry] If all Members on your Stage are part of \"Guilty Kiss\" (\"Riko\", \"Yoshiko\" and \"Mari\") and all three are on your Stage, draw two cards, then place one card from your Hand on the top or bottom of your Deck.'),
(481,'LL12-045',NULL,0,155,'【登場時】あなたのステージにいる全員が「CYaRon！」のメンバー（「千歌」「曜」「ルビィ」）で、３人全員がそろっているなら、手札からライブ衣装のメンバー１人を《登場》してよい。','[Entry] If all Members on your Stage are part of \"CYaRon!\" (\"Chika\", \"You\" and \"Ruby\") and all three are on your Stage, ⟪ENTER⟫ one Member with a Live Costume from your Hand.'),
(482,'LL12-046',NULL,0,158,'【登場時】/【ライブ成功時】あなたのライブ中のメンバー３人につき、カードを１枚引く。（【RUSH】は【登場時】の後に行う。）','[Entry]/[Live Success] For every three Members currently in your Lives, draw one card. (Resolve [Entry] before [RUSH].)'),
(483,'LL12-047',NULL,0,159,'【ライブ成功時】この《ライブ》に参加しているメンバー全員が持つピースの合計が、《ライブ》している楽曲カードのスコアより多いなら、余っているピースの種類（【赤】か【緑】か【青】か【オール】）１つにつき、カードを２枚引く。','[Live Success] If the total number of Pieces of the Members who joined this ⟪LIVE⟫ is higher than the requirement of the Song card used for this ⟪LIVE⟫, draw two cards for each Piece Attribute ([SMILE], [PURE], [COOL] or [ALL]) that exceeds the requirement.'),
(484,'LL12-048',NULL,0,160,'【登場時】あなたのセットリストにある表向きの楽曲カード１枚を裏向きにしてよい。そうしたら、デッキの１番上のカードを《登場》する。','[Entry] You may flip one face-up Song card in your Set List face-down. If you do, ⟪ENTER⟫ the top card of your Deck.'),
(485,'LL12-048',NULL,1,15,'【ライブ成功時】あなたのセットリストにある裏向きのカード１枚を表向きにする。','[Live Success] Flip one Song card in your Set List face-up.'),
(486,'LL12-049',NULL,0,161,'【登場時】『カードを２枚引く。』を選んでよい。そうしたら、それを行い、このメンバーの【RUSH】と【LIVE】は行えない。（【RUSH】と【LIVE】は【登場時】の後に行う。）','[Entry] You may draw two cards. If you do, you cannot use this Member\'s [RUSH] or [LIVE]. (Resolve [Entry] before [RUSH] or [LIVE].)'),
(487,'LL12-050',NULL,0,162,'【ライブ参加時】この《ライブ》に参加するライブ衣装のメンバー１人が持つピースは【【赤】【緑】【青】】になる。','[Live Join] The Pieces of one Member with a Live Costume joining this ⟪LIVE⟫ change to [[SMILE][PURE][COOL]].'),
(488,'LL12-051',NULL,0,163,'【登場時】カードを３枚引く。（【RUSH】はカードを引いた後に行う。）このターンの最後に、あなたは手札すべてを裏向きにしてよく混ぜてデッキの１番下に置く。','[Entry] Draw three cards. (Draw before using [RUSH].) At the end of this turn, shuffle all cards in your Hand and return them to the bottom of your Deck.'),
(489,'LL12-052',NULL,0,164,'【ライブ参加時】この《ライブ》に参加するメンバーが同じ種類のピース（【赤】か【緑】か【青】か【オール】）を合計４個以上持つなら、＋【赤】する。','[Live Join] If the Members joining this ⟪LIVE⟫ have four or more of one Piece Attribute ([SMILE], [PURE], [COOL] or [ALL]) in total, gain +[SMILE].'),
(490,'LL12-052',NULL,1,165,'【ライブ参加時】この《ライブ》に参加するほかのメンバーが持つピースがすべて同じ種類なら、＋【赤】する。','[Live Join] If the all the Pieces of all other Members joining this ⟪LIVE⟫ have the same attribute ([SMILE], [PURE], [COOL] or [ALL]), gain +[SMILE].'),
(491,'LL12-053',NULL,0,166,'【登場時】『あなたのデッキの１番上のカードを表向きにして、手札からメンバー１人を全員に見せる。』を行ってよい。そうしたら、次にターンを行うあいてはどちらかのメンバーを選び、あなたはそれを《登場》する。','[Entry] You may flip the top card of your deck and show one Member from your Hand to everyone. If you do, the next player in turn order must choose one of these Members. ⟪ENTER⟫ that chosen Member.'),
(492,'LL12-054',NULL,0,167,'【オート】あなたがこのメンバーを手札からデッキに置くなら、デッキに置く代わりにこのメンバーを《登場》してよい。','[Auto] If you to return this card from your Hand to your Deck, you may ⟪ENTER⟫ it instead of putting it in the Deck.'),
(493,'LL12-055',NULL,0,168,'【ライブ中】あなたとすべてのあいてのほかの楽曲カードのスキルに書かれている『{{skilltext:もう１回ターンを行う。}}』は『《勧誘》する。』になる。','[While Live] When resolving Skills on your or another player\'s Song cards besides this one, treat each occurence of \"{{skilltext:Take another turn}}\" as \"⟪SCOUT⟫\".'),
(494,'LL12-056',NULL,0,169,'【オート】あなたのターンに、この楽曲カードが表向きになったとき、《勧誘》する。','[Auto] On your turn, after this card is flipped face-up, ⟪SCOUT⟫.'),
(495,'LL12-056',NULL,1,170,'【ライブ参加時】あなたのステージにメンバーが９人以上いるなら、この《ライブ》に参加するメンバー１人に＋【緑】する。','[Live Join] If there are nine or more Members on your Stage, one Member joining this ⟪LIVE⟫ gains +[PURE].'),
(496,'LL12-057',NULL,0,171,'【ライブ参加時】あなたのライブ中の「CYaRon！」の楽曲カード１枚につき、共通スコアが１減る。（この楽曲カードは枚数に含めない。）','[Live Join] For each \"CYaRon!\" Song card that is Live on your Stage, the Any Piece requirement is reduced by 1. (Do not count this card.)'),
(497,'LL12-058',NULL,0,171,'【ライブ参加時】あなたのライブ中の「AZALEA」の楽曲カード１枚につき、共通スコアが１減る。（この楽曲カードは枚数に含めない。）','[Live Join] For each \"AZALEA\" Song card that is Live on your Stage, the Any Piece requirement is reduced by 1. (Do not count this card.)'),
(498,'LL12-059',NULL,0,171,'【ライブ参加時】あなたのライブ中の「Guilty Kiss」の楽曲カード１枚につき、共通スコアが１減る。（この楽曲カードは枚数に含めない。）','[Live Join] For each \"Guilty Kiss\" Song card that is Live on your Stage, the Any Piece requirement is reduced by 1. (Do not count this card.)'),
(499,'LL12-060',NULL,0,172,'【ライブ参加時】この《ライブ》に【☆】を１個持つメンバーと【☆】を２個持つメンバーと【☆】を３個持つメンバーが参加するなら、共通スコアが３減る。','[Live Join] If at least one Member with 1 Star, one Member with 2 Stars and one Member with 3 Stars are joining this ⟪LIVE⟫, the Any Piece requirement is reduced by 3.'),
(500,'LL12-061',NULL,0,173,'【ライブ成功時】あなたのステージにメンバーが３人全員そろっている、「CYaRon！」か「AZALEA」か「Guilty Kiss」のユニット１つにつき、手札から【☆】を持たないメンバー１人を《登場》してよい。','[Live Success] For each subunit (\"CYaRon!\", \"AZALEA\" and \"Guilty Kiss\") with all three of it\'s Members on your Stage, you may ⟪ENTER⟫ one Member without Stars from your Hand.'),
(501,'LL12-062',NULL,0,174,'【ライブ成功時】すべてのあいては、ターンを行う順番でそれぞれ手札から【☆】を持たないメンバー１人を《登場》してよい。','[Live Success] All other players may ⟪ENTER⟫ one Member without Stars from their Hand at the start of their next turn.'),
(502,'LL12-063',NULL,0,175,'【ライブ成功時】あなたのステージにいるメンバーとあなたを合わせてちょうど１０人なら、もう１回ターンを行う。','[Live Success] If the number of Members on your Stage plus yourself is exactly ten, take another turn.'),
(503,'LL12-064',NULL,0,176,'【待機中】あなたは自分のターンごとに行動を選ぶまで、デッキの１番上のカードを見てよい。','[On Stand-By] On your turn, you may look at the top card of your Deck before taking an action.'),
(504,'LL12-064',NULL,1,177,'【ライブ成功時】デッキの１番上のカードを見る。そのメンバーが【☆】を持たないなら、《登場》してよい。','[Live Success] Look at the top card of your Deck. If it is a Member without Stars, you may ⟪ENTER⟫ it.'),
(505,'LL12-065',NULL,0,176,'【待機中】あなたは自分のターンごとに行動を選ぶまで、デッキの１番上のカードを見てよい。','[On Stand-By] On your turn, you may look at the top card of your Deck before taking an action.'),
