(557,'LL13-046',NULL,0,475,'【登場時】手札から「μ\'s」のメンバー１人を《登場》してよい。その後、あなたの手札が０枚なら、《勧誘》する。(《登場》したメンバーの【登場時】や【RUSH】、【LIVE】より先に《勧誘》する。)','[Entry] You may ⟪ENTER⟫ one \"µ\'s\" Member from your Hand. Then, if you have no cards in your Hand, ⟪SCOUT⟫. (⟪SCOUT⟫ before resolving [Entry], [RUSH] and/or [LIVE] of the ⟪ENTER⟫ed Member.)'),
(558,'LL13-047',NULL,0,476,'【ライブ成功時】獲得ライブPが４点以上の楽曲カードの《ライブ》に参加しているなら、手札から【☆】を持たないメンバー１人を《登場》してよい。（基本ライブＰと追加ライブＰを合計した点数を見る。）','[Live Success] If the Song card of the ⟪LIVE⟫ this Member joined is worth 4 or more Live Points, you may ⟪ENTER⟫ one Member without Stars from your Hand. (Count both Base Live Points and the Bonus Live Points you earned.)'),
(559,'LL13-048',NULL,0,477,'【登場時】あなたのデッキの上から４枚を全員に見せて、その中にいる【RUSH】か【LIVE】かライブ衣装を持つ「μ\'s」のメンバーをそれぞれ１人ずつ手札に加える。その後、残りのカードを裏向きにしてよく混ぜてデッキの１番下に置く。','[Entry] Show the top ４ cards of your Deck to everyone, and pick up to one \"µ\'s\" Member with [RUSH], [LIVE], or a Live Costume each from them to add to your Hand. Then, shuffle the rest and return them to the bottom of your Deck.'),
(560,'LL13-049',NULL,0,478,'【登場時】あなたのセットリストにある裏向きのカード１枚を表向きにする。（【LIVE】は【登場時】の後に行う。）','[Entry] Flip one Song card in your Set List face-up. (Resolve [Entry] before [LIVE].)'),
(561,'LL13-050',NULL,0,479,'【登場時】このターン、あなたは「μ\'s」のメンバーの【RUSH】で２回目以降もメンバーを《登場》してよい。','[Entry] For this turn, you may use every [RUSH] from \"µ\'s\" Members to ⟪ENTER⟫ cards, even if it is the second or further time [RUSH] is used this turn.'),
(562,'LL13-051',NULL,0,480,'【登場時】カードを１枚引く。その後、あなたは手札１枚を全員に見せてよい。そうしたら、そのメンバーが持つ【☆】１個につき、カードを１枚引く。','[Entry] Draw one card. Then, you may show one card from your Hand to everyone. If you do, draw one card for each Star that Member has.'),
(563,'LL13-052',NULL,0,481,'【登場時】あなたのデッキの１番上のカードを表向きにする。そのメンバーが【☆】を持たないなら、それを《登場》する。【☆】を持つなら、このメンバーを参加させて《ライブ》してよい。','[Entry] Flip the top card of your Deck. If it\'s a Member without Stars, ⟪ENTER⟫ them. If it\'s a Member with Stars, you may perform a ⟪LIVE⟫ with this Member.'),
(564,'LL13-053',NULL,0,482,'【ライブ成功時】あなたかあいてのライブ中のメンバーのなかに【☆】を３個以上持つメンバーがいるなら、カードを２枚引く。','[Live Success] If there is a Member with three or more Stars that is Live on your or another player\'s Stage, draw two cards.'),
(565,'LL13-054',NULL,0,483,'【ライブ成功時】この《ライブ》に参加しているメンバーが合計で、【赤】２個以上と【緑】２個以上と【青】２個以上を持つなら、手札から【☆】を持たないメンバー１人を《登場》してよい。','[Live Success] If the Members who joined this ⟪LIVE⟫ have two or more [SMILE], two or more [PURE] and two or more [COOL] in total, you may ⟪ENTER⟫ one Member without Stars from your Hand.'),
(566,'LL13-055',NULL,0,484,'【ライブ参加時】この《ライブ》に【☆】を持つ「μ\'s」のメンバーが３人以上参加するなら、通常スコアが【３２３】になる。','[Live Join] If three or more \"µ\'s\" Members with Stars are joining this ⟪LIVE⟫, the Attribute Piece requirement changes to [323].'),
(567,'LL13-056',NULL,0,485,'【ライブ成功時】この《ライブ》に参加しているメンバー全員が【オール】を持たないなら、手札から【☆】を持たない「μ\'s」のメンバーを２人まで《登場》してよい。','[Live Success] If none of the Members who joined this ⟪LIVE⟫ have [ALL], ⟪ENTER⟫ up to two \"µ\'s\" Members without Stars from your Hand.'),
(568,'LL13-057',NULL,0,486,'【ライブ成功時】この《ライブ》に【RUSH】を持つ「μ\'s」のメンバーが参加しているなら、カードを２枚引く。','[Live Success] If a \"µ\'s\" Member with [RUSH] joined this ⟪LIVE⟫, draw two cards.'),
(569,'LL13-057',NULL,1,487,'【ライブ成功時】この《ライブ》に【LIVE】を持つ「μ\'s」のメンバーが参加しているなら、手札から【☆】を持たないメンバー１人を《登場》してよい。','[Live Success] If a \"µ\'s\" Member with [LIVE] joined this ⟪LIVE⟫, you may ⟪ENTER⟫ one Member without Stars from your Hand.'),
(570,'LL13-058',NULL,0,488,'【ライブ参加時】あなたの手札が０枚なら、共通スコアが２減る。','[Live Join] If you have no cards in your Hand, the Any Piece requirement is reduced by 2.'),
(571,'LL13-058',NULL,1,489,'【ライブ参加時】この《ライブ》にあなたの待機中のメンバー全員が参加するなら、共通スコアが２減る。','[Live Join] If all of your Members on Stand-By are joining this ⟪LIVE⟫, the Any Piece requirement is reduced by 2.'),
(572,'LL13-059',NULL,0,490,'【ライブ中】あなたのステージにいる全員が「Printemps」のメンバー（「穂乃果」「ことり」「花陽」）で、３人全員がそろっているなら、♪ライブP＋１♪する。','[While Live] If all Members on your Stage are part of \"Printemps\" (\"Honoka\", \"Kotori\" and \"Hanayo\") and all three are on your Stage, gain ♪Live Points +1♪.'),
(573,'LL13-060',NULL,0,491,'【ライブ成功時】あなたのステージに「穂乃果」「ことり」「海未」「花陽」「凛」「真姫」「にこ」「絵里」「希」がいるなら、もう１回ターンを行う。','[Live Success] If \"Honoka\", \"Kotori\", \"Umi\", \"Hanayo\", \"Rin\", \"Maki\", \"Nico\", \"Eli\" and \"Nozomi\" are on your Stage, take another turn.'),
(574,'LL13-061',NULL,0,492,'【ライブ中】あなたのライブ中の楽曲カードが３色以上あるなら、♪ライブP＋１♪する。','[While Live] If the Song cards that are Live on your Stage have three or more different Attributes, gain ♪Live Points +1♪.'),
(575,'LL13-062',NULL,0,490,'【ライブ中】あなたのステージにいる全員が「lily white」のメンバー（「海未」「凛」「希」）で、３人全員がそろっているなら、♪ライブP＋１♪する。','[While Live] If all Members on your Stage are part of \"lily white\" (\"Umi\", \"Rin\" and \"Nozomi\") and all three are on your Stage, gain ♪Live Points +1♪.'),
(576,'LL13-063',NULL,0,490,'【ライブ中】あなたのステージにいる全員が「BiBi」のメンバー（「にこ」「真姫」「絵里」）で、３人全員がそろっているなら、♪ライブP＋１♪する。','[While Live] If all Members on your Stage are part of \"BiBi\" (\"Nico\", \"Maki\" and \"Eli\") and all three are on your Stage, gain ♪Live Points +1♪.'),
(577,'LL13-064',NULL,0,493,'【自動】あなたの「μ\'s」の楽曲カードの《ライブ》が成功したとき、その《ライブ》に参加しているメンバー全員が持つピースの合計が、《ライブ》している楽曲カードのスコアより２個以上多いなら、手札から【☆】を持たないメンバーを２人まで《登場》してよい。','[Auto] When you successfully perform a ⟪LIVE⟫ with a \"µ\'s\" Song card, if the amount of Pieces the Members who joined that ⟪LIVE⟫ have in total is at least two more than the Song card\'s requirement, ⟪ENTER⟫ up to two Members without Stars from your Hand.'),
(578,'LL13-065',NULL,0,494,'【自動】あなたが「μ\'s」の楽曲カードを《ライブ》するとき、前のあなたのターンに《ライブ》していないなら、その《ライブ》に参加するメンバー１人に＋【オール】する。','[Auto] If you haven\'t performed a ⟪LIVE⟫ in your previous turn, one Member joining a ⟪LIVE⟫ with a \"µ\'s\" Song card gains +[ALL].'),
(579,'LL13-066',NULL,0,494,'【自動】あなたが「μ\'s」の楽曲カードを《ライブ》するとき、前のあなたのターンに《ライブ》していないなら、その《ライブ》に参加するメンバー１人に＋【オール】する。','[Auto] If you haven\'t performed a ⟪LIVE⟫ in your previous turn, one Member joining a ⟪LIVE⟫ with a \"µ\'s\" Song card gains +[ALL].'),
(580,'LL13-067',NULL,0,495,'【自動】あなたの「μ\'s」の楽曲カードの《ライブ》が成功したとき、その《ライブ》に参加しているメンバーが４人以上いるなら、カードを２枚引く。','[Auto] When you successfully perform a ⟪LIVE⟫ with a \"µ\'s\" Song card, if four or more Members joined that ⟪LIVE⟫, draw two cards.'),
(581,'LL13-068',NULL,0,494,'【自動】あなたが「μ\'s」の楽曲カードを《ライブ》するとき、前のあなたのターンに《ライブ》していないなら、その《ライブ》に参加するメンバー１人に＋【オール】する。','[Auto] If you haven\'t performed a ⟪LIVE⟫ in your previous turn, one Member joining a ⟪LIVE⟫ with a \"µ\'s\" Song card gains +[ALL].'),
(582,'LL13-069',NULL,0,493,'【自動】あなたの「μ\'s」の楽曲カードの《ライブ》が成功したとき、その《ライブ》に参加しているメンバー全員が持つピースの合計が、《ライブ》している楽曲カードのスコアより２個以上多いなら、手札から【☆】を持たないメンバーを２人まで《登場》してよい。','[Auto] When you successfully perform a ⟪LIVE⟫ with a \"µ\'s\" Song card, if the amount of Pieces the Members who joined that ⟪LIVE⟫ have in total is at least two more than the Song card\'s requirement, ⟪ENTER⟫ up to two Members without Stars from your Hand.'),
