(652,'LL14-072',NULL,1,532,'【自動】あなたの通常スコアの楽曲カードの《ライブ》に参加する「理亞」の【青】のピースをすべて【オール】にする。','[Auto] Treat the [COOL] of \"Leah\" cards joining ⟪LIVE⟫s with a Song card with an Attribute Piece requirement as [ALL].'),
