(816,'LL16-076',NULL,1,540,'【登場時】あなたのセットリストに、スキルに「{{skilltext:Aqours}}」と書かれている表向きの楽曲カードがあるなら、カードを２枚引く。このメンバーが覚醒済みなら、さらに手札からメンバー１人を《登場》してよい。','[Entry] If there is a face-up Song card in your Set List that contains \"{{skilltext:Aqours}}\" in it\'s Skill text, draw two cards. Then, if this Member is Idolized, you may ⟪ENTER⟫ one Member from your Hand.'),
