(818,'LL16-077',NULL,1,541,'【登場時】このメンバーが覚醒済みなら、このメンバーとあなたの待機中のライブ衣装のメンバー１人を参加させて、そのメンバーのライブ衣装と同名の楽曲カードを《ライブ》してよい。','[Entry] If this Member is Idolized, you may perform a ⟪LIVE⟫ with this Member, a Member with a Live Costume on Stand-By on your Stage, and a Song card with the same name as that Member\'s Live Costume.'),
