(821,'LL16-079',NULL,0,352,'【特別練習】【RUSH】を持つ「花丸」','[Special Practice] With a \"Hanamaru\" with [RUSH]'),
(822,'LL16-079',NULL,1,543,'【登場時】このメンバーが覚醒済みなら、あなたのコレクションから【RUSH】を持つ「花丸」１人を全員に見せて手札に加えてよい。','[Entry] If this Member is Idolized, you may show one \"Hanamaru\" card with [RUSH] from your Collection to everyone, then add it to your Hand.'),
