(824,'LL16-080',NULL,1,544,'【ライブ参加時】このメンバーが覚醒済みで、この《ライブ》に持っているピースがすべて【オール】のメンバーが２人以上参加するなら、＋【オール】【オール】する。','[Live Join] If this Member is Idolized, and two or more Members joining this ⟪LIVE⟫ only have [ALL] Pieces, gain +[ALL][ALL].'),
(825,'LL16-081',NULL,0,356,'【特別練習】このターンに《登場》した、ピースをちょうど１個持つ「ルビィ」','[Special Practice] With a \"Ruby\" that was ⟪ENTER⟫ed this turn and with exactly one Piece'),
(826,'LL16-081',NULL,1,545,'【登場時】このメンバーが覚醒済みなら、カードを３枚引く。そうでないなら、このメンバーを手札に戻し、デッキの１番上のカードを《登場》する。','[Entry] If this Member is Idolized, draw 3 cards. If not, return this Member to your Hand, and ⟪ENTER⟫ the top card of your Deck.'),
