(851,'LL17-047',NULL,0,554,'【ライブ参加時】あなたのセットリストにある楽曲カード１枚をコレクションに移動してよい。そうしたら、＋【オール】する。（裏向きの楽曲カードもコレクションに移動できる。）','[Live Join] You may bring one Song card from your Set List to your Collection. If you do, gain +[ALL]. (You can also bring face-down Song cards to your Collection.)'),
