(854,'LL17-049',NULL,0,555,'【ライブ参加時】あなたの手札が１枚以上あるなら、＋【オール】する。手札が４枚以上あるなら、さらに＋【オール】する。','[Live Join] If you have one or more cards in your Hand, gain +[ALL]. If you have four or more, gain +[ALL].'),
(855,'LL17-050',NULL,0,556,'【登場時】あなたのほかの待機中のメンバー１人を裏向きでデッキの１番下に置いてよい。そうしたら、《登場》してよい。《登場》したメンバーがライブ衣装を持つなら、カードを２枚引く。','[Entry] You may return one other Member on Stand-By on your Stage to the bottom of your Deck. If you do, you may ⟪ENTER⟫ a card. If the Member you ⟪ENTER⟫ed has a Live Costume, draw two cards.'),
(856,'LL17-051',NULL,0,557,'【登場時】カードを１枚引く。その後、手札からピースをちょうど１個持つメンバー１人を《登場》してよい。','[Entry] Draw one card. Then, you may ⟪ENTER⟫ one Member who has exactly one Piece from your Hand.'),
(857,'LL17-052',NULL,0,558,'【ライブ成功時】あなたのデッキの１番上のカードを表向きにする。表向きにしたメンバーが【☆】を持つなら、手札に加える。【☆】を持たないなら、それを《登場》する。','[Live Success] Flip the top card of your Deck. If it\'s a Member with Stars, add them to your Hand. If it\'s a Member without Stars, ⟪ENTER⟫ them.'),
(858,'LL17-053',NULL,0,559,'【ライブ参加時】この《ライブ》に参加するほかのメンバー１人のピースをすべて【オール】にしてよい。','[Live Join] You may treat all Pieces of one Member joining this ⟪LIVE⟫ as [ALL].'),
(859,'LL17-054',NULL,0,560,'【登場時】/【ライブ成功時】あなたのデッキの上からカード２枚を全員に見せ、その中から【☆】を持たないメンバー１人を《登場》してよい。残りのカードを好きな順番で裏向きでデッキの１番上か１番下に置く。（どちらかに残りすべてを置く。）','[Entry]/[Live Success] Show the top two cards of your Deck to everyone. You may pick one Member without Stars from them to ⟪ENTER⟫. Return the rest to the top or bottom of your Deck in any order. (Put all cards on the same side of your Deck.)'),
(860,'LL17-055',NULL,0,468,'【ライブ参加時】この《ライブ》に【RUSH】を持つメンバーが参加するなら、共通スコアが２減る。','[Live Join] If a Member with [RUSH] is joining this ⟪LIVE⟫, the Any Piece requirement is reduced by 2.'),
(861,'LL17-055',NULL,1,467,'【ライブ参加時】この《ライブ》に【LIVE】を持つメンバーが参加するなら、共通スコアが２減る。','[Live Join] If a Member with [LIVE] is joining this ⟪LIVE⟫, the Any Piece requirement is reduced by 2.'),
