(871,'LL17-065',NULL,0,380,'【ライブ参加時】この《ライブ》に「Aqours」のメンバーが２人以上参加するなら、共通スコアが２減る。','[Live Join] If two or more \"Aqours\" Members are joining this ⟪LIVE⟫, the Any Piece requirement is reduced by 2.'),
(872,'LL17-066',NULL,0,568,'【ライブ参加時】この《ライブ》に参加するメンバーが持つピースがすべて同じ種類（【赤】か【緑】か【青】か【オール】）なら、共通スコアが５減る。','[Live Join] If the all the Pieces of all Members joining this ⟪LIVE⟫ have the same attribute ([SMILE], [PURE], [COOL] or [ALL]), the Any Piece requirement is reduced by 5.'),
