(887,'LL17-080',NULL,0,556,'【登場時】あなたのほかの待機中のメンバー１人を裏向きでデッキの１番下に置いてよい。そうしたら、《登場》してよい。《登場》したメンバーがライブ衣装を持つなら、カードを２枚引く。','[Entry] You may return one other Member on Stand-By on your Stage to the bottom of your Deck. If you do, you may ⟪ENTER⟫ a card. If the Member you ⟪ENTER⟫ed has a Live Costume, draw two cards.'),
