(889,'LL17-082',NULL,0,558,'【ライブ成功時】あなたのデッキの１番上のカードを表向きにする。表向きにしたメンバーが【☆】を持つなら、手札に加える。【☆】を持たないなら、それを《登場》する。','[Live Success] Flip the top card of your Deck. If it\'s a Member with Stars, add them to your Hand. If it\'s a Member without Stars, ⟪ENTER⟫ them.'),
