(977,'EX05-036',NULL,0,67,'【ライブ中】「{{song:夏色えがおで1,2,Jump！}}」の《ライブ》に参加しているなら、♪ライブP＋１♪する。（ライブ衣装が「{{costume:夏色えがおで1,2,Jump！}}」の名前が異なるメンバーが３人なら、獲得ライブPは４点になる。）','[While Live] If this Member joins a ⟪LIVE⟫ with \"{{song:Natsuiro Egao de 1,2,Jump!}}\", gain ♪Live Points +1♪. (If there are three differently named Members with the \"{{costume:Natsuiro Egao de 1,2,Jump!}}\" Live Costume joining this ⟪LIVE⟫, it will be worth four Live Points.)'),
(978,'EX05-037',NULL,0,68,'【登場時】あなたのデッキの上からカード３枚を全員に見せて、その中にいる「μ\'s」のメンバーから名前が異なるように１人ずつ手札に加える。その後、残りのカードを好きな順番で裏向きでデッキの１番下に置く。','[Entry] Show the top three cards of your Deck to everyone. For each differently named \"µ\'s\" Member in them, pick one of their cards to add to your Hand. Then, return the rest to the bottom of your Deck in any order.'),
(979,'EX05-038',NULL,0,69,'【登場時】あなたのデッキの上からカード３枚を全員に見せる。その中にいるピースを３個以上持つメンバーから１人を《登場》して、残りのカードを好きな順番で裏向きでデッキの１番下に置く。《登場》したメンバーがピースを４個以上持つなら、もう１回ターンを行う。','[Entry] Show the top three cards of your Deck to everyone, and pick one Member with three or more Pieces from them to ⟪ENTER⟫. Then, return the rest to the bottom of your Deck. If the chosen Member has four or more Pieces, take another turn.'),
(980,'EX05-039',NULL,0,70,'【ライブ参加時】「μ’s」の楽曲カードの《ライブ》に参加するなら、このメンバーと、この《ライブ》に参加するライブ衣装の「μ’s」のメンバー全員を、《ライブ》する楽曲のライブ衣装にする。','[Live Join] If this Member joins a ⟪LIVE⟫ with a \"µ\'s\" Song, treat all \"µ\'s\" Members joining this ⟪LIVE⟫ as having the Live Costume with the same name as the Song.'),
(981,'EX05-040',NULL,0,71,'【登場時】あなたのステージにいるメンバーがすべて「海未」で、あなたのセットリストに表向きの楽曲カードが２枚以上あるなら、表向きの楽曲カード１枚を裏向きにしてよい。そうしたら、デッキの１番上のカードを《登場》する。','[Entry] If all Members on your Stage are \"Umi\" and you have two or more face-up Song cards in your Set List, you may flip one face-up Song card face-down. If you do so, ⟪ENTER⟫ the top card of your Deck.'),
(982,'EX05-041',NULL,0,72,'【登場時】あなたの待機中の【RUSH】を持つメンバーが２人以上いるなら、それら全員とこのメンバーを参加させて《ライブ》してよい。','[Entry] If there are two or more Members with [RUSH] on Stand-By on your Stage, you may perform a ⟪LIVE⟫ with all of them and this Member.'),
(983,'EX05-041',NULL,1,73,'【ライブ成功時】この《ライブ》に参加している【RUSH】を持つ「凛」１人につき、カードを１枚引く。','[Live Success] For each \"Rin\" card with [RUSH] who joined this ⟪LIVE⟫, draw one card.'),
(984,'EX05-042',NULL,0,74,'【登場時】あなたのセットリストにある表向きの楽曲カード１枚を裏向きにしてよい。そうしたら、あなたのセットリストにある裏向きのカードをすべて見る。その中から「μ\'s」の楽曲カード１枚を表向きにして、残りを裏向きのままよく混ぜる。','[Entry] You may flip one face-up Song card face-down. If you do so, look at all the face-down Song cards in your Set List and flip one \"µ\'s\" Song card face-up, then shuffle the other cards and flip them face-down again.'),
(985,'EX05-043',NULL,0,75,'【登場時】あなたの手札を全員に見せてよい。見せたカードが１枚か２枚ですべて「希」なら、このメンバーを参加させて《ライブ》してよい。３枚以上ですべて「希」なら、デッキの１番下のカードを《登場》する。（その後、手札を元に戻す。）','[Entry] You may show your Hand to all players. If you do so with one or two cards, and all of them are \"Nozomi\", you may perform a ⟪LIVE⟫ with this Member. If you do so with three or more cards, and all of them are \"Nozomi\", ⟪ENTER⟫ the bottom card of your Deck. (Hide your Hand again after this.)'),
(986,'EX05-044',NULL,0,76,'【登場時】あなたのセットリストに表向きの共通スコアの楽曲カードがあるなら、あなたのデッキの１番上のカードを表向きにする。表向きにしたメンバーが「花陽」なら、《登場》する。そうでないなら、それを手札に加え、カードを１枚引く。','[Entry] If there are any face-up Song cards with an Any Piece requirement in your Set List, flip the top card of your Deck. If the flipped card is \"Hanayo\", ⟪ENTER⟫ it. If not, add it to your Hand and draw one card.'),
(987,'EX05-045',NULL,0,77,'【登場時】あなたのセットリストに表向きの赤と緑の楽曲カードがあるなら、カードを２枚引く。緑と青があるなら、手札から【☆】を持たないメンバー１人を《登場》してよい。青と赤があるなら、このメンバーを参加させて《ライブ》してよい。（３色ともあるならすべて行う。）','[Entry] If there are face-up Smile and Pure Song cards in your Set List, draw two cards. If there are face-up Pure and Cool Song cards in your Set List, you may ⟪ENTER⟫ one Member without Stars from your Hand. If there are face-up Cool and Smile Song cards in your Set List, you may perform a ⟪LIVE⟫ with this Member. (If there are face-up Song cards of all three Attributes, do everything.)'),
