(1032,'EX09-053',NULL,1,15,'【ライブ成功時】あなたのセットリストにある裏向きのカード１枚を表向きにする。','[Live Success] Flip one Song card in your Set List face-up.'),
(1033,'EX09-054',NULL,0,82,'【登場時】手札１枚を裏向きでデッキの１番下に置いてよい。そうしたら、カードを２枚引くか、手札からメンバー１人を《登場》する。','[Entry] You may return one card from your Hand to the bottom of your Deck. If you do, either draw two cards or ⟪ENTER⟫ one Member from your Hand.'),
(1034,'EX09-055',NULL,0,83,'【登場時】あなたはデッキの１番上のカードを見る。次にターンを行うあいてはそれが【☆】を持つか持たないかを答える。答えが合っていたなら、それを全員に見せて手札に加え、カードを１枚引く。違っていたなら、そのメンバーを《登場》する。','[Entry] Look at the top card of your Deck. The next player in turn order must guess whether it has Stars or not. If they guess correctly, show the card to everyone, add it to your Hand and draw one card. If they guess incorrectly, ⟪ENTER⟫ that Member.'),
(1035,'EX09-056',NULL,0,84,'【登場時】あなたのデッキの上からカード４枚を全員に見せて、その中にいるライブ衣装で【☆】を持たないメンバーから、１人を《登場》して１人を手札に加える。その後、残りのカードを裏向きにしてよく混ぜてデッキの１番下に置く。（１人しかいなくても《登場》できる。）','[Entry] Look at the top four cards of your Deck, and from the Members without Stars and with a Live Costume, pick one to ⟪ENTER⟫ and one to add to your Hand. Then, shuffle the other cards and return them to the bottom of your Deck. (If there is only one Member meeting the conditions, ⟪ENTER⟫ them.)'),
(1036,'EX09-057',NULL,0,85,'【登場時】手札から【☆】を持たないメンバーを３人まで《登場》してよい。これでメンバーを１人以上《登場》したなら、次のあなたのターンを１回休む。','[Entry] You may ⟪ENTER⟫ up to three Members without Stars from your Hand. If you ⟪ENTER⟫ at least one Member this way, skip your next turn.'),
(1037,'EX09-058',NULL,0,86,'【登場時】あなたはカードを３枚引く。すべてのあいてはカードを１枚引く。','[Entry] Draw three cards. All other players draw one card.'),
(1038,'EX09-059',NULL,0,263,'（【RUSH】か【LIVE】のどちらかを選んで行う。）','(Choose either [RUSH] or [LIVE].)'),
(1039,'EX09-060',NULL,0,87,'【登場時】あなたのデッキの１番上のカードを《登場》してよい。そのメンバーが【☆】を２個以上持つなら、このメンバーを裏向きでデッキの１番下に置く。（デッキから《登場》したメンバーの【登場時】より先にデッキの１番下に置く。）','[Entry] You may ⟪ENTER⟫ the top card of your Deck. If you do and that Member has two or more Stars, return this Member to the bottom of your Deck. (Return this Member to the Deck before resolving any [Entry] Skills.)'),
(1040,'EX10-001',NULL,0,324,'【ライブ参加時】あなたのステージにいる全員がライブ衣装が「{{costume:MIRAI TICKET}}」のメンバーで、それぞれ名前が異なるメンバーで「{{song:MIRAI TICKET}}」の《ライブ》に参加するなら、＋【赤】【緑】【青】する。','[Live Join] If all Members on your Stage have the \"{{costume:MIRAI TICKET}}\" Live Costume, the Song card used for this ⟪LIVE⟫ is \"{{song:MIRAI TICKET}}\", and all Members joining this ⟪LIVE⟫ are differently named, gain +[SMILE][PURE][COOL].'),
(1041,'EX10-002',NULL,0,325,'【登場時】あなたのセットリストにある表向きの楽曲カードが２枚以下なら、裏向きのカード１枚を表向きにする。','[Entry] If there are two or less face-up Song cards in your Set List, flip one face-down Song card in your Set List face-up.'),
(1042,'EX10-002',NULL,1,326,'【登場時】あなたのセットリストに表向きの「{{song:MIRAI TICKET}}」があるなら、デッキの１番上のカードを《登場》する。','[Entry] If there is a face-up \"{{song:MIRAI TICKET}}\" in your Set List, ⟪ENTER⟫ the top card of your deck.'),
(1043,'EX10-003',NULL,0,327,'【登場時】あなたのデッキの１番上か１番下のカードを全員に見せる。それがライブ衣装が「{{costume:MIRAI TICKET}}」のメンバーなら、それを《登場》する。（そうでないなら、それを元に戻す。）','[Entry] Show the top or bottom card of your Deck to everyone. If that Member has the \"{{costume:MIRAI TICKET}}\" Live Costume, ⟪ENTER⟫ them. (If not, return it.)'),
(1044,'EX10-004',NULL,0,328,'【登場時】カードを３枚引く。その後、手札３枚を好きな順番で裏向きでデッキの１番上か１番下に置く。（どちらかに３枚すべてを置く。）','[Entry] Draw three cards. Then, return three cards from your Hand to the top or bottom of your Deck in any order. (Put all cards on the same side of your Deck.)'),
(1045,'EX10-005',NULL,0,329,'【ライブ参加時】この《ライブ》に参加する全員がライブ衣装が「{{costume:MIRAI TICKET}}」のメンバーで、「{{song:MIRAI TICKET}}」の《ライブ》に参加するなら、＋【緑】【緑】する。','[Live Join] If all Members joining this ⟪LIVE⟫ have the \"{{costume:MIRAI TICKET}}\" Live Costume, and the Song card used for this ⟪LIVE⟫ is \"{{song:MIRAI TICKET}}\", gain +[PURE][PURE].'),
(1046,'EX10-006',NULL,0,330,'【登場時】あなたのデッキの上からカード３枚を全員に見せて、その中にいるライブ衣装が「{{costume:MIRAI TICKET}}」のメンバーを名前が異なるように２人まで手札に加える。その後、残りのカードを好きな順番で裏向きでデッキの１番下に置く。','[Entry] Show the top ３ cards of your Deck to everyone, and pick up to two differently named Members with the \"{{costume:MIRAI TICKET}}\" Live Costume from them to add to your Hand. Then, return the rest to the bottom of your Deck in any order.'),
(1047,'EX10-007',NULL,0,331,'【ライブ参加時】あなたのステージにいる全員がライブ衣装が「{{costume:MIRAI TICKET}}」のメンバーで、あなたの手札が３枚以上あるなら、＋【オール】する。','[Live Join] If all Members on your Stage have the \"{{costume:MIRAI TICKET}}\" Live Costume, and you have three or more cards in your Hand, gain +[ALL].'),
(1048,'EX10-008',NULL,0,332,'【登場時】ライブ衣装が「{{costume:MIRAI TICKET}}」のメンバーのスキルによってデッキから《登場》したなら、このメンバーを参加させて《ライブ》してよい。','[Entry] If this Member was ⟪ENTER⟫ed from your Deck using the Skill of a Member with the \"{{costume:MIRAI TICKET}}\" Live Costume, you may perform a ⟪LIVE⟫ with this Member.'),
(1049,'EX10-009',NULL,0,333,'【登場時】手札２枚を好きな順番で裏向きでデッキの１番下に置いてよい。そうしたら、このメンバーを参加させて《ライブ》してよい。','[Entry] You may return two cards from your Hand to the bottom of your Deck in any order. If you do, you may perform a ⟪LIVE⟫ with this Member.'),
(1050,'EX11-001',NULL,0,334,'【ライブ成功時】この《ライブ》に参加しているメンバーがすべて「穂乃果」なら、カードを２枚引き、手札１枚を裏向きでデッキの１番上に置く。','[Live Success] If all Members who joined this ⟪LIVE⟫ are \"Honoka\" cards, draw two cards and return one card from your Hand to the top of your Deck.'),
(1051,'EX11-002',NULL,0,335,'【登場時】あなたのステージにいるメンバーがすべて「絵里」なら、あなたのセットリストにある表向きの基本ライブPが４点以上の楽曲カードの枚数に１を加えた枚数のカードを引く。','[Entry] If all Members on your Stage are \"Eli\", draw a number of cards equal to the number of Song cards in your Set List with 4 or more Base Live Points, plus one additional card.'),
(1052,'EX11-003',NULL,0,336,'【登場時】/【ライブ成功時】手札から、あなたのセットリストにある表向きの「μ\'s」の楽曲カードと同名のライブ衣装で、【☆】を持たないメンバー１人を《登場》してよい。','[Entry]/[Live Success] You may ⟪ENTER⟫ one Member without Stars that has a Live Costume with the same name as a face-up \"µ\'s\" Song card in your Set List from your Hand.'),
(1053,'EX11-004',NULL,0,265,'「海未」のスキルによって手札にあるこのメンバーを見せている間、【☆】を持たないメンバーとして扱う。',' If this Member is revealed from your Hand as the result of a Skill of a \"Umi\" card, treat this Member as a Member without Stars.'),
(1054,'EX11-004',NULL,1,337,'【登場時】「海未」の【登場時】スキルによって手札から《登場》したなら、カードを１枚引き、もう１回ターンを行う。','[Entry] If this Member was ⟪ENTER⟫ed from your Hand using the [Entry] Skill of a \"Umi\" card, draw one card and take another turn.'),
(1055,'EX11-005',NULL,0,338,'【登場時】あなたのステージにいるメンバーの名前がちょうど３種類なら、手札からライブ衣装でなく【☆】を持たないメンバー１人を《登場》してよい。','[Entry] If there are exactly three differently named Members on your Stage, you may ⟪ENTER⟫ one Member without Stars and without a Live Costume from your Hand.'),
(1056,'EX11-006',NULL,0,339,'【ライブ成功時】この《ライブ》に参加しているメンバーがすべて「真姫」なら、あなたのセットリストにある裏向きのカード１枚を表向きにする。','[Live Success] If all Members who joined this ⟪LIVE⟫ are \"Maki\" cards, flip one Song card in your Set List face-up.'),
(1057,'EX11-007',NULL,0,104,'【ライブ参加時】スキルに「{{skilltext:μ\'s}}」と書かれている楽曲カードの《ライブ》に参加するなら、＋【緑】する。','[Live Join] If the Song card used for this ⟪LIVE⟫ contains \"{{skilltext:µ\'s}}\" in it\'s Skill text, gain +[PURE].'),
(1058,'EX11-008',NULL,0,340,'【ライブ参加時】この《ライブ》に参加するメンバーの名前がちょうど３種類なら、＋【緑】【赤】する。','[Live Join] If there are exactly three differently named Members joining this ⟪LIVE⟫, gain +[PURE][SMILE].'),
(1059,'EX11-009',NULL,0,341,'【登場時】あなたのステージにいるメンバーの名前がちょうど３種類なら、このメンバーを参加させて《ライブ》してよい。','[Entry] If there are exactly three differently named Members on your Stage, you may perform a ⟪LIVE⟫ with this Member.'),
(1060,'EX11-010',NULL,0,322,'【登場時】このターンにほかのメンバーが《登場》していたなら、カードを２枚引く。','[Entry] If another Member was ⟪ENTER⟫ed this turn, draw two cards.'),
(1061,'EX11-011',NULL,0,322,'【登場時】このターンにほかのメンバーが《登場》していたなら、カードを２枚引く。','[Entry] If another Member was ⟪ENTER⟫ed this turn, draw two cards.'),
(1062,'EX11-012',NULL,0,322,'【登場時】このターンにほかのメンバーが《登場》していたなら、カードを２枚引く。','[Entry] If another Member was ⟪ENTER⟫ed this turn, draw two cards.'),
(1063,'EX11-013',NULL,0,322,'【登場時】このターンにほかのメンバーが《登場》していたなら、カードを２枚引く。','[Entry] If another Member was ⟪ENTER⟫ed this turn, draw two cards.'),
(1064,'EX11-014',NULL,0,322,'【登場時】このターンにほかのメンバーが《登場》していたなら、カードを２枚引く。','[Entry] If another Member was ⟪ENTER⟫ed this turn, draw two cards.'),
(1065,'EX11-015',NULL,0,322,'【登場時】このターンにほかのメンバーが《登場》していたなら、カードを２枚引く。','[Entry] If another Member was ⟪ENTER⟫ed this turn, draw two cards.'),
(1066,'EX11-016',NULL,0,322,'【登場時】このターンにほかのメンバーが《登場》していたなら、カードを２枚引く。','[Entry] If another Member was ⟪ENTER⟫ed this turn, draw two cards.'),
(1067,'EX11-017',NULL,0,322,'【登場時】このターンにほかのメンバーが《登場》していたなら、カードを２枚引く。','[Entry] If another Member was ⟪ENTER⟫ed this turn, draw two cards.'),
(1068,'EX11-018',NULL,0,322,'【登場時】このターンにほかのメンバーが《登場》していたなら、カードを２枚引く。','[Entry] If another Member was ⟪ENTER⟫ed this turn, draw two cards.'),
(1069,'EX11-019',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「穂乃果」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Honoka\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1070,'EX11-020',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「絵里」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Eli\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1071,'EX11-021',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「ことり」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Kotori\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1072,'EX11-022',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「海未」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Umi\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1073,'EX11-023',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「凛」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Rin\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1074,'EX11-024',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「真姫」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Maki\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1075,'EX11-025',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「希」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Nozomi\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1076,'EX11-026',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「花陽」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Hanayo\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1077,'EX11-027',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「にこ」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Nico\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1078,'EX11-028',NULL,0,360,'【登場時】あなたのデッキの１番上のカードを表向きにする。表向きにしたメンバーが【赤】を持つなら、《登場》する。そうでないなら、それを手札に加える。','[Entry] Flip the top card of your deck. If it\'s a Member with [SMILE], ⟪ENTER⟫ them. If not, add the card to your Hand.'),
(1079,'EX11-029',NULL,0,361,'【ライブ参加時】あなたのライブ中の楽曲カード１枚につき、このメンバーの【青】のピース１個は【オール】になる。（このメンバーが参加する《ライブ》は枚数に含めない。）','[Live Join] For each Song card that is Live on your Stage, treat one of this Member\'s [COOL] as [ALL]. (Do not count the Song card used for this ⟪LIVE⟫.)'),
(1080,'EX11-030',NULL,0,362,'【登場時】次にターンを行うあいてに『カードを３枚引く。』と『手札からメンバー１人を《登場》してよい。』をお願いする。そのあいてはどちらかのお願いを聞き入れる。（あなたはそれを行う。）','[Entry] Ask the next player in turn order either \"May I draw three cards?\" or \"May I ⟪ENTER⟫ one Member from my Hand?\". The next player can choose which of these two requests to grant you.'),
(1081,'EX11-031',NULL,0,363,'【ライブ参加時】あなたのセットリストにある表向きの楽曲カードの中でもっともスコアが大きい楽曲カードの《ライブ》に参加するなら、＋【青】する。（通常スコアの楽曲カードは【赤】と【緑】と【青】を合計する。）','[Live Join] If this Member joins a ⟪LIVE⟫ with the Song card that has the highest requirement among all of the face-up Song cards in your Set List, gain +[COOL]. (For Song cards with an Attribute Piece Requirement, use the total [SMILE][PURE][COOL].)'),
(1082,'EX11-032',NULL,0,364,'【登場時】あなたのほかの待機中の「μ\'s」のメンバー１人を手札に戻してよい。そうしたら、手札から、戻したメンバーと同じ名前で【☆】の数が異なるメンバー１人を《登場》してよい。','[Entry] You may return one other \"µ\'s\" Member on Stand-By to your Hand. If you do, you may ⟪ENTER⟫ one Member that has the same name as the returned Member, but a different amount of Stars from your Hand.'),
(1083,'EX11-033',NULL,0,365,'【登場時】あなたのセットリストにある表向きの楽曲カードが２色以上あるなら、カードを２枚引く。４色あるなら、さらにもう１回ターンを行う。','[Entry] If the face-up Song cards in your Set List have two or more different Attributes, draw two cards. If there are four, take another turn.'),
(1084,'EX11-034',NULL,0,366,'【登場時】あなたは手札１枚を全員に見せて裏向きでデッキの１番下に置いてよい。下に置いたメンバーが【☆】を持つなら、もう１回ターンを行う。【☆】を持たないなら、カードを２枚引く。','[Entry] You may show one card from your Hand to everyone and then return it to the bottom of your Deck. If you return a Member with Stars, take another turn. If you return a Member without Stars, draw two cards.'),
(1085,'EX11-035',NULL,0,367,'【登場時】あなたのほかの待機中の【☆】を持つメンバーが３人以上いるなら、このメンバーを参加させて《ライブ》してよい。','[Entry] If there are three or more Members with Stars on Stand-By on your Stage, you may perform a ⟪LIVE⟫ with this Member.'),
(1086,'EX11-036',NULL,0,368,'【ライブ成功時】これがあなたの２曲目の《ライブ》なら、カードを２枚引き、手札２枚を好きな順番で裏向きでデッキの１番下に置く。','[Live Success] If this is your second ⟪LIVE⟫, draw two cards, then return two cards to the bottom of your Deck in any order.'),
(1087,'EX11-037',NULL,0,15,'【ライブ成功時】あなたのセットリストにある裏向きのカード１枚を表向きにする。','[Live Success] Flip one Song card in your Set List face-up.'),
(1088,'EX11-038',NULL,0,370,'【ライブ成功時】この《ライブ》に「穂乃果」と「凛」が参加しているなら、《勧誘》し、手札からライブ衣装でなく【☆】を持たないメンバー１人を《登場》してよい。','[Live Success] If both \"Honoka\" and \"Rin\" joined this ⟪LIVE⟫, ⟪SCOUT⟫. Then, you may ⟪ENTER⟫ one Member without Stars and without a Live Costume from your Hand.'),
(1089,'EX11-039',NULL,0,369,'【ライブ成功時】この《ライブ》に「希」と「にこ」が参加しているなら、あなたのデッキの１番下のカードを手札に加えて、手札から【☆】を持たない「にこ」１人を《登場》してよい。','[Live Success] If both \"Nozomi\" and \"Nico\" joined this ⟪LIVE⟫, add the bottom card of your Deck to your Hand. Then, you may ⟪ENTER⟫ one \"Nico\" card without Stars from your Hand.'),
(1090,'EX11-040',NULL,0,371,'【ライブ成功時】この《ライブ》に「ことり」と「花陽」が参加しているなら、手札からライブ衣装で【☆】を持たないメンバー１人を《登場》してよい。','[Live Success] If both \"Kotori\" and \"Hanayo\" joined this ⟪LIVE⟫, you may ⟪ENTER⟫ one Member without Stars and with a Live Costume from your Hand.'),
(1091,'EX11-041',NULL,0,372,'【ライブ中】この《ライブ》に「絵里」と「海未」と「真姫」が参加しているなら、♪ライブP＋１♪し、あなたがセットリストにある裏向きのカードを表向きにする場合さらに１枚を表向きにする。（この《ライブ》も含む。）','[While Live] If \"Eli\", \"Umi\" and \"Maki\" all joined this ⟪LIVE⟫, gain ♪Live Points +1♪, and whenever you flip a Song card in your Set List face-up, flip one more Song card face-up. (Including the Song card flipped face-up from this ⟪LIVE⟫.)'),
(1092,'EX11-042',NULL,0,373,'【ライブ中】この《ライブ》に参加している全員がライブ衣装でないメンバーで、「にこ」「凛」「花陽」が参加しているなら、♪ライブP＋１♪する。','[While Live] If all Members who joined this ⟪LIVE⟫ don\'t have Live Costumes, and \"Nico\", \"Rin\" and \"Hanayo\" all joined this ⟪LIVE⟫, gain ♪Live Points +1♪.'),
(1093,'EX11-043',NULL,0,374,'【ライブ中】この《ライブ》に「lily white」のメンバーが３人全員そろって参加しているなら、あなたの「lily white」のメンバーが３人全員そろって参加しているほかのライブ中の楽曲カード１枚につき、♪ライブP＋１♪する。','[While Live] If all three members of \"lily white\" joined this ⟪LIVE⟫, gain ♪Live Points +1♪ for each Live with all three members of \"lily white\" other than this one.'),
(1094,'EX11-044',NULL,0,375,'【ライブ成功時】この《ライブ》に「BiBi」のメンバーが３人全員そろって参加しているなら、あなたのコレクションから【☆】を３個持つ「μ\'s」のメンバー１人を全員に見せて手札に加えてよい。','[Live Success] If all three members of \"BiBi\" joined this ⟪LIVE⟫, you may show one \"µ\'s\" Member with three Stars from your Collection to everyone, then add it to your Hand.'),
(1095,'EX11-045',NULL,0,376,'【ライブ中】この《ライブ》に「Printemps」のメンバーが３人全員そろって参加しているなら、あなたの《ライブ》に参加する「Printemps」のメンバー全員に＋【緑】する。','[While Live] If all three members of \"Printemps\" joined this ⟪LIVE⟫, all \"Printemps\" Members joining your Lives gain +[PURE].'),
(1096,'EX11-046',NULL,0,377,'【ライブ参加時】この《ライブ》に参加する全員が「μ\'s」のメンバーで前のあなたのターンからステージにいるなら、共通スコアが３減る。','[Live Join] If all Members joining this ⟪LIVE⟫ are part of \"µ\'s\" and have been on your Stage before this turn, the Any Piece requirement is reduced by 3.'),
(1097,'EX11-047',NULL,0,194,'【ライブ成功時】この《ライブ》に参加している全員が「μ\'s」のメンバーで【オール】を合計３個以上持つなら、もう１回ターンを行う。','[Live Success] If all Members who joined this ⟪LIVE⟫ are part of \"µ\'s\" and they have total of three or more [ALL], take another turn.'),
(1098,'EX11-048',NULL,0,378,'【ライブ成功時】この《ライブ》に「μ\'s」のメンバーが３人以上参加しているなら、カードを３枚引き、手札１枚を裏向きでデッキの１番上に置く。','[Live Success] If three or more \"µ\'s\" Members joined this ⟪LIVE⟫, draw three cards, then return one card from your Hand to the top of your Deck.'),
(1099,'EX11-049',NULL,0,379,'【ライブ参加時】あなたのステージに「穂乃果」「希」「凛」「花陽」「にこ」「ことり」「海未」「絵里」「真姫」がいるなら、共通スコアが９減る。','[Live Join] If \"Honoka\", \"Nozomi\", \"Rin\", \"Hanayo\", \"Nico\", \"Kotori\", \"Umi\", \"Eli\" and \"Maki\" are on your Stage, the Any Piece requirement is reduced by 9.'),
(1100,'EX11-050',NULL,0,94,'【ライブ参加時】この《ライブ》に参加するメンバーが同じ種類のピース（【赤】か【緑】か【青】か【オール】）を合計４個以上持つなら、共通スコアが２減る。','[Live Join] If the Members joining this ⟪LIVE⟫ have four or more of one Piece Attribute ([SMILE], [PURE], [COOL] or [ALL]) in total, the Any Piece requirement is reduced by 2.'),
(1101,'EX11-051',NULL,0,380,'【ライブ参加時】この《ライブ》に「μ\'s」のメンバーが２人以上参加するなら、共通スコアが２減る。','[Live Join] If two or more \"µ\'s\" Members are joining this ⟪LIVE⟫, the Any Piece requirement is reduced by 2.'),
(1102,'EX11-052',NULL,0,342,'【スタート時】/【登場時】『あなたは手札すべてを裏向きにしてよく混ぜてデッキの１番下に置き、カードを４枚引く。』をしてよい。','[Starter]/[Entry] You may shuffle all cards in your Hand and return them to the bottom of your Deck. If you do, draw four cards.'),
(1103,'EX11-053',NULL,0,342,'【スタート時】/【登場時】『あなたは手札すべてを裏向きにしてよく混ぜてデッキの１番下に置き、カードを４枚引く。』をしてよい。','[Starter]/[Entry] You may shuffle all cards in your Hand and return them to the bottom of your Deck. If you do, draw four cards.'),
