(1119,'EX11-069',NULL,0,342,'【スタート時】/【登場時】『あなたは手札すべてを裏向きにしてよく混ぜてデッキの１番下に置き、カードを４枚引く。』をしてよい。','[Starter]/[Entry] You may shuffle all cards in your Hand and return them to the bottom of your Deck. If you do, draw four cards.'),
(1120,'EX12-019',NULL,0,98,'【登場時】あなたの手札が０枚なら、カードを３枚引く。あなたのほかの待機中のメンバーが０人なら、デッキの１番上のカードを《登場》する。あなたのライブ中の楽曲カードが０枚なら、このメンバーを参加させて《ライブ》してよい。','[Entry] If you have no cards in your Hand, draw three cards. If there are no Members on Stand-By on your Stage, ⟪ENTER⟫ the top card of your Deck. If you have no Song cards that are Live on your Stage, you may perform a ⟪LIVE⟫ with this Member.'),
(1121,'EX12-020',NULL,0,99,'【登場時】次のあなたのターンの終わりまで、このメンバーは《ライブ》に参加できない。（【RUSH】は【登場時】の後に行う。）','[Entry] This Member cannot join a ⟪LIVE⟫ until the end of your next turn. (Resolve [Entry] before [RUSH].)'),
(1122,'EX12-020',NULL,1,100,'【ライブ参加時】この《ライブ》にほかの「Aqours」のメンバーが参加するなら、＋【青】する。','[Live Join] If another \"Aqours\" Member is joining this ⟪LIVE⟫, gain +[COOL].'),
(1123,'EX12-021',NULL,0,101,'【登場時】あなたの待機中のメンバーの中に【LIVE】を持つメンバーがいるなら、その中の１人とこのメンバーを参加させて《ライブ》してよい。','[Entry] If there are Members on Stand-By with [LIVE] on your Stage, you may perform a ⟪LIVE⟫ with one of them and this Member.'),
(1124,'EX12-021',NULL,1,102,'【ライブ参加時】この《ライブ》に【LIVE】を持つ「果南」が参加するなら、＋【オール】する。','[Live Join] If a \"Kanan\" card with [LIVE] is joining this ⟪LIVE⟫, gain +[ALL].'),
(1125,'EX12-022',NULL,0,103,'【ライブ参加時】この《ライブ》に参加する全員が「Aqours」のメンバーなら、＋【青】する。','[Live Join] If all Members joining this ⟪LIVE⟫ are \"Aqours\" cards, gain +[COOL].'),
(1126,'EX12-022',NULL,1,104,'【ライブ参加時】スキルに「{{skilltext:Aqours}}」と書かれている楽曲カードの《ライブ》に参加するなら、＋【オール】する。','[Live Join] If the Song card used for this ⟪LIVE⟫ contains \"{{skilltext:Aqours}}\" in it\'s Skill text, gain +[ALL].'),
(1127,'EX12-023',NULL,0,105,'【登場時】あなたのほかの待機中のライブ衣装でないメンバー１人を手札に戻してよい。そうしたら、カードを２枚引く。その後、戻したメンバーと同じ名前の、ライブ衣装のメンバー１人を手札から《登場》してよい。','[Entry] You may return one of your other Members on Stand-By without a Live Costume to your Hand. If you do, draw two cards. After that, you may ⟪ENTER⟫ one Member with a Live Costume and the same name as the Member you returned.'),
(1128,'EX12-024',NULL,0,106,'【登場時】あなたのほかの待機中のメンバー１人を裏向きでデッキの１番下に置いてよい。そうしたら、カードを３枚引く。','[Entry] You may return one of your other Members on Stand-By to the bottom of your Deck. If you do, draw three cards.'),
(1129,'EX12-024',NULL,1,107,'【ライブ参加時】あなたの手札が３枚以上あるなら、＋【青】する。','[Live Join] If you have three or more cards in your Hand, gain +[COOL].'),
(1130,'EX12-025',NULL,0,108,'【登場時】【RUSH】によって《登場》したなら、デッキの１番上のカードを《登場》する。','[Entry] If this Member was ⟪ENTER⟫ed using [RUSH], ⟪ENTER⟫ the top card of your Deck.'),
(1131,'EX12-025',NULL,1,28,'【ライブ参加時】あなたのライブ中の楽曲カードが２枚以上あるなら、＋【赤】する。（このメンバーが参加する《ライブ》は枚数に含めない。）','[Live Join] If you already performed two or more Lives, gain +[SMILE]. (The ⟪LIVE⟫ this Member is joining does not count.)'),
(1132,'EX12-026',NULL,0,109,'【ライブ参加時】この《ライブ》に、【赤】を持つメンバーと、【緑】を持つメンバーと、【青】を持つメンバーと、【オール】を持つメンバーが参加するなら、＋【オール】する。（それぞれ１人ずつ必要で、このメンバーを含めてもよい。）','[Live Join] If there is a Member with [SMILE], a Member with [PURE], a Member with [COOL] and a Member with [ALL] joining this ⟪LIVE⟫, gain +[ALL]. (You need a seperate Member card for each. You may count this Member.)'),
(1133,'EX12-027',NULL,0,110,'【登場時】あなたのデッキの１番上か１番下のカードを全員に見せる。そのメンバーが【☆】を持つなら、それを《登場》する。そうでないなら、それを手札に加え、カードを１枚引く。','[Entry] Show the top or bottom card of your Deck to everyone. If that Member has Stars, ⟪ENTER⟫ them. If not, add them to your Hand and draw one card.'),
(1134,'EX12-028',NULL,0,381,'【登場時】あなたのステージにいるメンバーがすべて「千歌」なら、手札から【☆】を持たないメンバー１人を《登場》してよい。前のあなたのターンにあなたが《勧誘》していたなら、さらに手札からメンバー１人を《登場》してよい。','[Entry] If all Members on your Stage are \"Chika\" cards, you may ⟪ENTER⟫ one Member without Stars from your Hand. Additionally, if you ⟪SCOUT⟫ed in your previous turn, you may ⟪ENTER⟫ one Member from your Hand.'),
(1135,'EX12-029',NULL,0,382,'【登場時】あなたのステージにいるメンバーがすべて「梨子」なら、カードを２枚引く。前のターンをあなたが行っていたなら、さらにカードを２枚引く。','[Entry] If all Members on your Stage are \"Riko\" cards, draw two cards. Additionally, if the previous turn was yours, draw two cards.'),
(1136,'EX12-030',NULL,0,383,'【登場時】あなたのステージにいるメンバーがすべて「果南」なら、カードを３枚引く。','[Entry] If all Members on your Stage are \"Kanan\" cards, draw three cards.'),
(1137,'EX12-030',NULL,1,384,'【ライブ参加時】この《ライブ》にメンバーが５人以上参加するなら、＋【オール】する。','[Live Join] If five or more Members are joining this ⟪LIVE⟫, gain +[ALL].'),
(1138,'EX12-031',NULL,0,385,'【ライブ参加時】あなたのステージにいるメンバーがすべて「ダイヤ」で、あなたの手札が２枚以上あるなら、＋【青】【青】する。','[Live Join] If all Members on your Stage are \"Dia\" cards, and you have two or more cards in your Hand, gain +[COOL][COOL].'),
(1139,'EX12-032',NULL,0,386,'【登場時】手札の枚数があなたのステージにいる「曜」のライブ衣装の種類数と同じになるまでカードを引く。','[Entry] Draw cards until the number of cards in your Hand is equal to the number of \"You\" cards with different Live Costumes on your Stage.'),
(1140,'EX12-032',NULL,1,387,'【登場時】あなたのステージにいるメンバーがすべて「曜」なら、手札からそれら全員と異なるライブ衣装で【☆】を持たない「曜」１人を《登場》してよい。','[Entry] If all Members on your Stage are \"You\" cards, you may ⟪ENTER⟫ one \"You\" card with a different Live Costume from the other Members and without Stars from your Hand.'),
(1141,'EX12-033',NULL,0,388,'【登場時】あなたのステージにいるメンバーがすべて「善子」なら、『あなたのステージにメンバーが６人以上いるなら、カードを２枚引く。』、『あなたの手札が６枚以上あるなら、手札から【☆】を持たないメンバー１人を《登場》してよい。』、『あなたのライブPが６点以上なら、このメンバーを参加させて《ライブ》してよい。』を行う。','[Entry] If all Members on your Stage are \"Yoshiko\" cards, do all of the following: ① If you have six or more Members on your Stage, draw two cards. ② If you have six or more cards in your Hand, you may ⟪ENTER⟫ one Member without Stars from your Hand. ③ If you have 6 or more Live Points, you may perform a ⟪LIVE⟫ with this Member.'),
(1142,'EX12-034',NULL,0,389,'【ライブ参加時】あなたのステージにいるメンバーがすべて「花丸」なら、この《ライブ》に参加しないあなたの待機中のメンバー１人を手札に戻してよい。そうしたら、＋【赤】【赤】する。','[Live Join] If all Members on your Stage are \"Hanamaru\" cards, you may return one Member on Stand-By who is not joining this ⟪LIVE⟫ to your Hand. If you do, gain +[SMILE][SMILE].'),
(1143,'EX12-035',NULL,0,390,'【登場時】あなたのステージにいるメンバーがすべて「鞠莉」なら、手札１枚を裏向きでデッキの１番下に置いてよい。そうしたら、あなたのコレクションから、持っているピースがすべて【オール】の「鞠莉」１人を全員に見せて手札に加えてよい。','[Entry] If all Members on your Stage are \"Mari\" cards, you may return one card from your Hand to the bottom of your Deck. If you do, you may show one \"Mari\" card whose Pieces are only [ALL] from your Collection to everyone, then add it to your Hand.'),
(1144,'EX12-036',NULL,0,391,'【登場時】あなたのステージにいるメンバーがすべて「ルビィ」なら、手札２枚を裏向きでデッキの１番上と１番下に１枚ずつ置いてよい。そうしたら、デッキの１番上のカードを《登場》する。','[Entry] If all Members on your Stage are \"Ruby\" cards, you may return two cards from your Hand to your Deck, one to the top and bottom each. If you do, ⟪ENTER⟫ the top card of your Deck.'),
(1145,'EX13-001',NULL,0,323,'【登場時】あなたのデッキの上からカードを３枚見て、１枚を手札に加えて、残りのカードを好きな順番で裏向きでデッキの１番下に置く。','[Entry] Look at the top three cards of your Deck and add one Member from them to your Hand. Then, return the other cards to the bottom of your Deck in any order.'),
(1146,'EX13-002',NULL,0,323,'【登場時】あなたのデッキの上からカードを３枚見て、１枚を手札に加えて、残りのカードを好きな順番で裏向きでデッキの１番下に置く。','[Entry] Look at the top three cards of your Deck and add one Member from them to your Hand. Then, return the other cards to the bottom of your Deck in any order.'),
(1147,'EX13-003',NULL,0,323,'【登場時】あなたのデッキの上からカードを３枚見て、１枚を手札に加えて、残りのカードを好きな順番で裏向きでデッキの１番下に置く。','[Entry] Look at the top three cards of your Deck and add one Member from them to your Hand. Then, return the other cards to the bottom of your Deck in any order.'),
(1148,'EX13-004',NULL,0,323,'【登場時】あなたのデッキの上からカードを３枚見て、１枚を手札に加えて、残りのカードを好きな順番で裏向きでデッキの１番下に置く。','[Entry] Look at the top three cards of your Deck and add one Member from them to your Hand. Then, return the other cards to the bottom of your Deck in any order.'),
(1149,'EX13-005',NULL,0,323,'【登場時】あなたのデッキの上からカードを３枚見て、１枚を手札に加えて、残りのカードを好きな順番で裏向きでデッキの１番下に置く。','[Entry] Look at the top three cards of your Deck and add one Member from them to your Hand. Then, return the other cards to the bottom of your Deck in any order.'),
(1150,'EX13-006',NULL,0,323,'【登場時】あなたのデッキの上からカードを３枚見て、１枚を手札に加えて、残りのカードを好きな順番で裏向きでデッキの１番下に置く。','[Entry] Look at the top three cards of your Deck and add one Member from them to your Hand. Then, return the other cards to the bottom of your Deck in any order.'),
(1151,'EX13-007',NULL,0,323,'【登場時】あなたのデッキの上からカードを３枚見て、１枚を手札に加えて、残りのカードを好きな順番で裏向きでデッキの１番下に置く。','[Entry] Look at the top three cards of your Deck and add one Member from them to your Hand. Then, return the other cards to the bottom of your Deck in any order.'),
(1152,'EX13-008',NULL,0,323,'【登場時】あなたのデッキの上からカードを３枚見て、１枚を手札に加えて、残りのカードを好きな順番で裏向きでデッキの１番下に置く。','[Entry] Look at the top three cards of your Deck and add one Member from them to your Hand. Then, return the other cards to the bottom of your Deck in any order.'),
(1153,'EX13-009',NULL,0,323,'【登場時】あなたのデッキの上からカードを３枚見て、１枚を手札に加えて、残りのカードを好きな順番で裏向きでデッキの１番下に置く。','[Entry] Look at the top three cards of your Deck and add one Member from them to your Hand. Then, return the other cards to the bottom of your Deck in any order.'),
(1154,'EX14-010',NULL,0,199,'（【RUSH】を持つメンバーが《登場》したとき、１ターンにつき１回まで、あなたは手札からメンバー１人を《登場》してよい。）','(Once per turn, when a Member with [RUSH] is ⟪ENTER⟫ed, you may ⟪ENTER⟫ another Member from your Hand.)'),
(1155,'EX14-011',NULL,0,200,'（【LIVE】を持つメンバーが《登場》したとき、あなたはそのメンバーを参加させて《ライブ》してよい。）','(When a Member with [LIVE] is ⟪ENTER⟫ed, you may perform a ⟪LIVE⟫ with this Member.)'),
(1156,'EX14-012',NULL,0,200,'（【LIVE】を持つメンバーが《登場》したとき、あなたはそのメンバーを参加させて《ライブ》してよい。）','(When a Member with [LIVE] is ⟪ENTER⟫ed, you may perform a ⟪LIVE⟫ with this Member.)'),
(1157,'EX14-013',NULL,0,199,'（【RUSH】を持つメンバーが《登場》したとき、１ターンにつき１回まで、あなたは手札からメンバー１人を《登場》してよい。）','(Once per turn, when a Member with [RUSH] is ⟪ENTER⟫ed, you may ⟪ENTER⟫ another Member from your Hand.)'),
(1158,'EX14-014',NULL,0,7,'【登場時】カードを１枚引く。','[Entry] Draw one card.'),
(1159,'EX14-015',NULL,0,7,'【登場時】カードを１枚引く。','[Entry] Draw one card.'),
(1160,'EX14-016',NULL,0,200,'（【LIVE】を持つメンバーが《登場》したとき、あなたはそのメンバーを参加させて《ライブ》してよい。）','(When a Member with [LIVE] is ⟪ENTER⟫ed, you may perform a ⟪LIVE⟫ with this Member.)'),
(1161,'EX14-017',NULL,0,7,'【登場時】カードを１枚引く。','[Entry] Draw one card.'),
(1162,'EX14-018',NULL,0,199,'（【RUSH】を持つメンバーが《登場》したとき、１ターンにつき１回まで、あなたは手札からメンバー１人を《登場》してよい。）','(Once per turn, when a Member with [RUSH] is ⟪ENTER⟫ed, you may ⟪ENTER⟫ another Member from your Hand.)'),
(1163,'EX14-028',NULL,0,98,'【登場時】あなたの手札が０枚なら、カードを３枚引く。あなたのほかの待機中のメンバーが０人なら、デッキの１番上のカードを《登場》する。あなたのライブ中の楽曲カードが０枚なら、このメンバーを参加させて《ライブ》してよい。','[Entry] If you have no cards in your Hand, draw three cards. If there are no Members on Stand-By on your Stage, ⟪ENTER⟫ the top card of your Deck. If you have no Song cards that are Live on your Stage, you may perform a ⟪LIVE⟫ with this Member.'),
(1164,'EX14-029',NULL,0,99,'【登場時】次のあなたのターンの終わりまで、このメンバーは《ライブ》に参加できない。（【RUSH】は【登場時】の後に行う。）','[Entry] This Member cannot join a ⟪LIVE⟫ until the end of your next turn. (Resolve [Entry] before [RUSH].)'),
(1165,'EX14-029',NULL,1,100,'【ライブ参加時】この《ライブ》にほかの「Aqours」のメンバーが参加するなら、＋【青】する。','[Live Join] If another \"Aqours\" Member is joining this ⟪LIVE⟫, gain +[COOL].'),
(1166,'EX14-030',NULL,0,101,'【登場時】あなたの待機中のメンバーの中に【LIVE】を持つメンバーがいるなら、その中の１人とこのメンバーを参加させて《ライブ》してよい。','[Entry] If there are Members on Stand-By with [LIVE] on your Stage, you may perform a ⟪LIVE⟫ with one of them and this Member.'),
(1167,'EX14-030',NULL,1,102,'【ライブ参加時】この《ライブ》に【LIVE】を持つ「果南」が参加するなら、＋【オール】する。','[Live Join] If a \"Kanan\" card with [LIVE] is joining this ⟪LIVE⟫, gain +[ALL].'),
(1168,'EX14-031',NULL,0,103,'【ライブ参加時】この《ライブ》に参加する全員が「Aqours」のメンバーなら、＋【青】する。','[Live Join] If all Members joining this ⟪LIVE⟫ are \"Aqours\" cards, gain +[COOL].'),
(1169,'EX14-031',NULL,1,104,'【ライブ参加時】スキルに「{{skilltext:Aqours}}」と書かれている楽曲カードの《ライブ》に参加するなら、＋【オール】する。','[Live Join] If the Song card used for this ⟪LIVE⟫ contains \"{{skilltext:Aqours}}\" in it\'s Skill text, gain +[ALL].'),
(1170,'EX14-032',NULL,0,105,'【登場時】あなたのほかの待機中のライブ衣装でないメンバー１人を手札に戻してよい。そうしたら、カードを２枚引く。その後、戻したメンバーと同じ名前の、ライブ衣装のメンバー１人を手札から《登場》してよい。','[Entry] You may return one of your other Members on Stand-By without a Live Costume to your Hand. If you do, draw two cards. After that, you may ⟪ENTER⟫ one Member with a Live Costume and the same name as the Member you returned.'),
(1171,'EX14-033',NULL,0,106,'【登場時】あなたのほかの待機中のメンバー１人を裏向きでデッキの１番下に置いてよい。そうしたら、カードを３枚引く。','[Entry] You may return one of your other Members on Stand-By to the bottom of your Deck. If you do, draw three cards.'),
(1172,'EX14-033',NULL,1,107,'【ライブ参加時】あなたの手札が３枚以上あるなら、＋【青】する。','[Live Join] If you have three or more cards in your Hand, gain +[COOL].'),
(1173,'EX14-034',NULL,0,108,'【登場時】【RUSH】によって《登場》したなら、デッキの１番上のカードを《登場》する。','[Entry] If this Member was ⟪ENTER⟫ed using [RUSH], ⟪ENTER⟫ the top card of your Deck.'),
(1174,'EX14-034',NULL,1,28,'【ライブ参加時】あなたのライブ中の楽曲カードが２枚以上あるなら、＋【赤】する。（このメンバーが参加する《ライブ》は枚数に含めない。）','[Live Join] If you already performed two or more Lives, gain +[SMILE]. (The ⟪LIVE⟫ this Member is joining does not count.)'),
(1175,'EX14-035',NULL,0,109,'【ライブ参加時】この《ライブ》に、【赤】を持つメンバーと、【緑】を持つメンバーと、【青】を持つメンバーと、【オール】を持つメンバーが参加するなら、＋【オール】する。（それぞれ１人ずつ必要で、このメンバーを含めてもよい。）','[Live Join] If there is a Member with [SMILE], a Member with [PURE], a Member with [COOL] and a Member with [ALL] joining this ⟪LIVE⟫, gain +[ALL]. (You need a seperate Member card for each. You may count this Member.)'),
(1176,'EX14-036',NULL,0,110,'【登場時】あなたのデッキの１番上か１番下のカードを全員に見せる。そのメンバーが【☆】を持つなら、それを《登場》する。そうでないなら、それを手札に加え、カードを１枚引く。','[Entry] Show the top or bottom card of your Deck to everyone. If that Member has Stars, ⟪ENTER⟫ them. If not, add them to your Hand and draw one card.'),
(1177,'EX14-037',NULL,0,115,'【登場時】あなたは手札にある「千歌」のカード２枚を全員に見せて好きな順番で裏向きでデッキの１番下に置いてよい。そうしたら、デッキの１番上のカードを《登場》する。','[Entry] You may show two \"Chika\" cards from your Hand to everyone, and then return them to the bottom of your Deck in any order. If you do, ⟪ENTER⟫ the top card of your Deck.'),
(1178,'EX14-038',NULL,0,116,'【登場時】あなたのステージにいるメンバーがすべて「梨子」で、あなたのセットリストにある表向きの楽曲カードが２色以上あるなら、もう１回ターンを行う。','[Entry] If all Members on your Stage are \"Riko\" cards and the face-up Song cards in your Set List have two or more different Attributes, take another turn.'),
(1179,'EX14-039',NULL,0,117,'【登場時】あなたのデッキの上からカード３枚を全員に見せる。その中からメンバー１人を手札に加えて、残りのカードを好きな順番で裏向きでデッキの１番下に置く。下に置いたのがすべて「果南」なら、手札から【LIVE】を持つ「果南」１人を《登場》してよい。','[Entry] Show the top three cards of your Deck to everyone, and pick one from them to add to your Hand. Then, return the rest to the bottom of your Deck in any order. If all of the returned cards are \"Kanan\" cards, you may ⟪ENTER⟫ a \"Kanan\" card with [LIVE] from your Hand.'),
(1180,'EX14-040',NULL,0,118,'【ライブ参加時】手札から《登場》し、自身の【LIVE】によって《ライブ》して、それに参加しているメンバーがすべて「ダイヤ」なら、＋【青】する。','[Live Join] If this Member was ⟪ENTER⟫ed from your Hand, joins a ⟪LIVE⟫ using their own [LIVE], and all Members joining this ⟪LIVE⟫ are \"Dia\" cards, gain +[COOL].'),
(1181,'EX14-041',NULL,0,119,'【登場時】あなたの待機中のメンバーがすべて「曜」なら、カードを２枚引く。さらに待機中の「曜」のライブ衣装が３種類以上あるなら、このメンバーを参加させて《ライブ》してよい。','[Entry] If all your Members on Stand-By are \"You\" cards, draw two cards. Then, if your \"You\" cards on Stand-By have three or more different Live Costumes, you may perform a ⟪LIVE⟫ with this Member.'),
(1182,'EX14-042',NULL,0,120,'【登場時】このゲームであなたがターンを休んでいたなら、このメンバーを参加させて《ライブ》してよい。ターンを休んでいないなら、カードを３枚引く。','[Entry] If you had to skip a turn in this match, you may perform a ⟪LIVE⟫ with this Member. If you haven\'t skipped any turns, draw three cards.'),
(1183,'EX14-042',NULL,1,121,'【ライブ参加時】この《ライブ》に参加するメンバーが４人以上で、すべて「善子」なら、＋【青】する。','[Live Join] If there are four or more Members joining this ⟪LIVE⟫ and all of them are \"Yoshiko\" cards, gain +[COOL].'),
(1184,'EX14-043',NULL,0,122,'【ライブ参加時】この《ライブ》に参加するメンバーがすべて「花丸」なら、参加するほかのメンバーの【赤】と【緑】と【青】のピースをすべて【オール】にする。','[Live Join] If all of the Members joining this ⟪LIVE⟫ are \"Hanamaru\" cards, treat the [SMILE][PURE][COOL] of all other Members joining this ⟪LIVE⟫ as [ALL].'),
(1185,'EX14-044',NULL,0,123,'【登場時】あなたのデッキの１番上のカードを表向きにする。表向きにしたメンバーが「鞠莉」なら、《勧誘》する。','[Entry] Flip the top card of your Deck. If that Member is a \"Mari\" card, ⟪SCOUT⟫.'),
(1186,'EX14-044',NULL,1,124,'【ライブ参加時】あなたは手札にある「鞠莉」のカード１枚を全員に見せてよい。そうしたら、＋【赤】か＋【緑】か＋【青】する。（その後、見せたカードを手札に戻す。）','[Live Join] You may show one \"Mari\" card from your Hand to everyone. If you do, gain either +[SMILE], +[PURE] or +[COOL]. (Return the card to your Hand after this.)'),
(1187,'EX14-045',NULL,0,125,'【登場時】デッキから《登場》したなら、カードを２枚引く。「ルビィ」のスキルによってデッキから《登場》したなら、さらに手札からメンバー１人を《登場》する。','[Entry] If this Member was ⟪ENTER⟫ed from your Deck, draw two cards. If this Member was ⟪ENTER⟫ed from your Deck with a Skill from a \"Ruby\" card, ⟪ENTER⟫ one Member from your Hand.'),
(1188,'EX14-046',NULL,0,7,'【ライブ成功時】カードを２枚引く。','[Live Success] Draw two cards.'),
(1189,'EX14-047',NULL,0,91,'【ライブ中】あなたやあいてが《勧誘》によってカードを引くなら、カードを引く枚数の上限に＋１する。（手札が４枚になるまでカードを引くなら、代わりに５枚になるまで引く。）','[While Live] Increase the draw limit for your and any other player\'s ⟪SCOUT⟫ by one. (If you were drawing until you had four cards in your Hand before, you\'re drawing until five cards now instead.)'),
(1190,'EX14-048',NULL,0,266,'AH!誰も恋への近道なんて知らない','AH! Daremo koi e no chikamichi nante shiranai'),
(1191,'EX14-048',NULL,1,267,'だけど、ね？　LOVE ME!','Dakedo, ne? LOVE ME!'),
(1192,'EX14-049',NULL,0,268,'(Trap in Dice)　 恋の罠から','(Trap in Dice) Koi no wana kara'),
(1193,'EX14-049',NULL,1,269,'(Trap in Night)　始まりたい','(Trap in Night) Hajimaritai'),
(1194,'EX14-049',NULL,2,270,'(Trap in Heart)　踊りながら人生のルーレット','(Trap in Heart) Odori nagara jinsei no ruuretto'),
(1195,'EX14-050',NULL,0,95,'【ライブ参加時】あなたのライブ中の楽曲カード１枚につき、共通スコアが１減る。（この楽曲カードは枚数に含めない。）','[Live Join] For each Song card that is Live on your Stage, the Any Piece requirement is reduced by 1. (Do not count this card.)'),
(1196,'EX14-051',NULL,0,271,'知りたい　触れたい','Shiritai furetai'),
(1197,'EX14-051',NULL,1,272,'今までどおりの私…それじゃイヤ　もうイヤだよ？　イヤ！','Ima made doori no watashi... sore ja iya mou iya da yo? Iya!'),
(1198,'EX15-010',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「穂乃果」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Honoka\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1199,'EX15-011',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「絵里」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Eli\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1200,'EX15-012',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「ことり」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Kotori\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1201,'EX15-013',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「海未」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Umi\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1202,'EX15-014',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「凛」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Rin\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1203,'EX15-015',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「真姫」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Maki\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1204,'EX15-016',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「希」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Nozomi\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1205,'EX15-017',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「花陽」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Hanayo\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1206,'EX15-018',NULL,0,114,'【登場時】あなたのステージにいるメンバーがすべて「にこ」なら、デッキの上からカードを２枚見て、１枚を手札に加えて、１枚を裏向きでデッキの１番下に置く。','[Entry] If all Members on your Stage are \"Nico\" cards, look at the top two cards of your Deck, add one to your Hand and return the other to the bottom of your Deck.'),
(1207,'EX15-019',NULL,0,392,'【登場時】あなたのステージにいるメンバーがすべて「穂乃果」なら、カードを１枚引く。このターンにほかのメンバーが《登場》していたなら、さらにこのメンバーを参加させて《ライブ》してよい。','[Entry] If all Members on your Stage are \"Honoka\" cards, draw one card. Additionally, if another Member was ⟪ENTER⟫ed this turn, you may perform a ⟪LIVE⟫ with this Member.'),
(1208,'EX15-020',NULL,0,393,'【登場時】あなたのステージにいるメンバーがすべて「絵里」なら、手札からメンバー１人を《登場》してよい。そうしたら、そのメンバーが持つ【☆】１個につき、カードを１枚引く。','[Entry] If all Members on your Stage are \"Eli\" cards, you may ⟪ENTER⟫ one Member from your Hand. If you do, draw one card for each Star that Member has.'),
(1209,'EX15-021',NULL,0,394,'【登場時】あなたのステージにいるメンバーがすべて「ことり」で、３人以上ライブ衣装を持つなら、手札からライブ衣装の「ことり」１人を《登場》してよい。（【LIVE】は【登場時】の後に行う。）','[Entry] If all Members on your Stage are \"Kotori\" cards and three or more of them have Live Costumes, you may ⟪ENTER⟫ one \"Kotori\" card with a Live Costume from your Hand. (Resolve [Entry] before [LIVE].)'),
(1210,'EX15-022',NULL,0,395,'【登場時】あなたのステージにいるメンバーがすべて「海未」なら、カードを１枚引き、手札から【RUSH】を持つメンバー１人を《登場》してよい。','[Entry] If all Members on your Stage are \"Umi\" cards, you may draw one cardone and ⟪ENTER⟫ one Member with [RUSH] from your Hand.'),
(1211,'EX15-023',NULL,0,396,'【登場時】あなたのステージにいるメンバーがすべて「凛」なら、あなたのデッキの１番上のカードを表向きにする。表向きにしたメンバーがピースをちょうど２個持つなら、《登場》する。そうでないなら、それを手札に加え、カードを１枚引く。','[Entry] If all Members on your Stage are \"Rin\" cards, flip the top card of your Deck. If it is a Member with exactly two Pieces, ⟪ENTER⟫ them. If not, add it to your Hand and draw one card.'),
(1212,'EX15-024',NULL,0,397,'【登場時】あなたのステージにいるメンバーがすべて「真姫」なら、《登場》してよい。（手札かデッキの１番上のどちらからでもよい。）','[Entry] If all Members on your Stage are \"Maki\" cards, you may ⟪ENTER⟫ a card. (You can choose between a card from your Hand or the top card of your Deck.)'),
(1213,'EX15-024',NULL,1,398,'【ライブ参加時】あなたのセットリストに裏向きのカードが４枚以上あるなら、＋【青】する。','[Live Join] If there are four or more face-down Song cards in your Set List, gain +[COOL].'),
(1214,'EX15-025',NULL,0,399,'【登場時】あなたのステージにいるメンバーがすべて「希」なら、あなたのデッキの下からカード２枚を全員に見せて、それらを手札に加える。その後、見せたメンバーが【☆】を合計で３個以上持つなら、手札からメンバー１人を《登場》してよい。','[Entry] If all Members on your Stage are \"Nozomi\" cards, show the bottom two cards of your Deck to everyone, then add them to your Hand. After that, if the Members you\'ve shown have three or more Stars in total, you may ⟪ENTER⟫ one card from your Hand.'),
(1215,'EX15-026',NULL,0,400,'【ライブ参加時】あなたのステージにいるメンバーがすべて「花陽」で、あなたの手札が１枚以上あるなら、＋【緑】する。５枚以上あるなら、さらに＋【緑】する。','[Live Join] If all Members on your Stage are \"Hanayo\" cards and you have one or more cards in your Hand, gain +[PURE]. Additionally, if you have five or more cards in your Hand, gain +[PURE].'),
(1216,'EX15-027',NULL,0,401,'【登場時】あなたのステージにいるメンバーがすべて「にこ」なら、『《勧誘》する。その後、手札から好きな枚数のカードを好きな順番で裏向きでデッキの１番下に置き、《勧誘》する。』を行う。','[Entry] If all Members on your Stage are \"Nico\" cards, ⟪SCOUT⟫. After that, return as many cards as you like to the bottom of your Deck in any order, then ⟪SCOUT⟫ again.'),
(1217,'EX15-028',NULL,0,34,'【ライブ参加時】【RUSH】によって《登場》し、自身の【LIVE】によって《ライブ》するなら、＋【オール】する。','[Live Join] If this Member was ⟪ENTER⟫ed using [RUSH], and joins a ⟪LIVE⟫ using their own [LIVE], gain +[ALL].'),
(1218,'EX15-029',NULL,0,18,'【登場時】あなたの待機中の「絵里」（このメンバーも含む）１人を手札に戻す。そのメンバーが持つ【☆】１個につき、カードを１枚引く。','[Entry] Return an \"Eli\" card on Stand-By (including this Member) to your Hand. For each Star the returned Member has, draw one card.'),
(1219,'EX15-030',NULL,0,36,'【ライブ参加時】この《ライブ》に参加する、ライブ衣装のメンバー全員に＋【オール】する。','[Live Join] All Members with a Live Costume joining this ⟪LIVE⟫ gain +[ALL].'),
(1220,'EX15-031',NULL,0,24,'【登場時】あなたのセットリストにある表向きの楽曲カードが３枚になるまで、裏向きのカードを表向きにする。その後、あなたのセットリストにある表向きの楽曲カードが３色以上あるなら、デッキの１番上のカードを《登場》する。','[Entry] Flip cards in your Set List face-up until you have three face-up Song cards. If the face-up Song cards in your Set List have three or more different Attributes, ⟪ENTER⟫ the top card of your Deck.'),
(1221,'EX15-032',NULL,0,20,'【登場時】【RUSH】によって《登場》したなら、デッキの１番上のカードを《登場》する。「凛」の【RUSH】によって《登場》したなら、さらにカードを１枚引く。（デッキから《登場》したメンバーの【登場時】より先にカードを１枚引く。）','[Entry] If this Member was ⟪ENTER⟫ed using [RUSH], ⟪ENTER⟫ the top card of your Deck. If this Member was ⟪ENTER⟫ed using [RUSH] from a \"Rin\" card, draw one card. (Draw before resolving the [Entry] Skill of the ⟪ENTER⟫ed card.)'),
(1222,'EX15-033',NULL,0,25,'【登場時】あなたのセットリストにある色が異なる表向きの楽曲カード１枚につき、カードを１枚引く。その後、あなたの手札が４枚以上あるなら、このメンバーを参加させて《ライブ》してよい。','[Entry] For each different Attribute of the face-up Song cards in your Set List, draw one card. If you have four or more cards in your Hand after this, you may perform a ⟪LIVE⟫ with this Member.'),
(1223,'EX15-034',NULL,0,38,'【ライブ参加時】あなたは手札２枚を好きな順番で裏向きでデッキの１番下に置いてよい。そうしたら、この《ライブ》に参加する自身以外のメンバー１人に、＋【オール】【オール】する。','[Live Join] You may return two cards from your Hand to the bottom of your Deck. If you do, one other Member joining this ⟪LIVE⟫ gains +[ALL][ALL].'),
(1224,'EX15-035',NULL,0,29,'【ライブ参加時】共通スコアの楽曲カードの《ライブ》に参加するなら、＋【緑】【緑】【緑】する。','[Live Join] If this Member joins a ⟪LIVE⟫ with an Any Piece requirement, gain +[PURE][PURE][PURE].'),
(1225,'EX15-036',NULL,0,32,'【ライブ参加時】この《ライブ》に参加するメンバーカードの半分以上が「にこ」なら、＋【赤】する。','[Live Join] If half or more of the Members joining this ⟪LIVE⟫ are \"Nico\" cards, gain +[SMILE].'),
(1226,'EX15-037',NULL,0,319,'【スタート時】/【登場時】手札から【☆】を持たないメンバーを２人まで《登場》してよい。','[Starter]/[Entry] You may ⟪ENTER⟫ up to two Members without Stars from your Hand.'),
