(1244,'EX15-E01',NULL,0,46,'【ライブ中】この《ライブ》に「穂乃果」「絵里」「ことり」「海未」「凛」「真姫」「希」「花陽」「にこ」が参加しているなら、♪ライブP＋９♪する。','[While Live] If \"Honoka\", \"Eli\", \"Kotori\", \"Umi\", \"Rin\", \"Maki\", \"Nozomi\", \"Hanayo\" and \"Nico\" joined this ⟪LIVE⟫, gain ♪Live Points +9♪.'),
(1245,'EX15-E02',NULL,0,55,'【ライブ参加時】この《ライブ》にすべて同じ名前のメンバーが参加するか、この《ライブ》に名前が異なるメンバーが５人以上参加するなら、この《ライブ》に参加するメンバー１人に＋【オール】【オール】【オール】する。','[Live Join] If all Members joining this ⟪LIVE⟫ have the same name, or there are five or more differently named Members joining this Live, one Member joining this Live gains +[ALL][ALL][ALL].'),
