(1256,'EX15-E09',NULL,0,58,'【ライブ成功時】この《ライブ》に参加している名前が異なるメンバー１人につき、カードを１枚引く。','[Live Success] For each differently named Member who joined this ⟪LIVE⟫, draw one card.'),
(1257,'EX15-E10',NULL,0,146,'【ライブ参加時】あなたのステージにいるメンバーがすべて「穂乃果」で、あなたの手札が１枚以上あるなら、共通スコアが４減る。','[Live Join] If all Members on your Stage are \"Honoka\" cards and you have one or more cards in your Hand, the Any Piece requirement is reduced by 4.'),
(1258,'EX15-E11',NULL,0,402,'【ライブ参加時】あなたのステージにいるメンバーがすべて「絵里」で、あなたのセットリストにある表向きの楽曲カードかあなたのライブ中の楽曲カードの中に、ほかの基本ライブPが３点以上の楽曲カードがあるなら、共通スコアが４減る。','[Live Join] If all Members on your Stage are \"Eli\" cards, and there is a face-up Song card with 3 or more Base Live Points that is in your Set List or Live on your Stage, the Any Piece requirement is reduced by 4.'),
(1259,'EX15-E12',NULL,0,403,'【ライブ参加時】あなたのステージにいるメンバーがすべて「ことり」で、この《ライブ》にライブ衣装で【☆】を持たないメンバーが２人以上参加するなら、共通スコアが４減る。','[Live Join] If all Members on your Stage are \"Kotori\" cards and there are two or more Members with a Live Costume and without Stars joining this ⟪LIVE⟫, the Any Piece requirement is reduced by 4.'),
(1260,'EX15-E13',NULL,0,404,'【ライブ参加時】あなたのステージにいるメンバーがすべて「海未」で、あなたのセットリストにある表向きの楽曲カードとあなたのライブ中の楽曲カードが合計で３枚以上あるなら、共通スコアが４減る。','[Live Join] If all Members on your Stage are \"Umi\" cards, and there are three or more total face-up Song cards that are in your Set List or Live on your Stage, the Any Piece requirement is reduced by 4.'),
(1261,'EX15-E14',NULL,0,405,'【ライブ参加時】あなたのステージにいるメンバーがすべて「凛」で、６人以上いるなら、共通スコアが４減る。','[Live Join] If all Members on your Stage are \"Rin\" cards and there\'s six or more of them, the Any Piece requirement is reduced by 4.'),
(1262,'EX15-E15',NULL,0,406,'【ライブ参加時】あなたのステージにいるメンバーがすべて「真姫」で、あなたのセットリストにある表向きの楽曲カードとあなたのライブ中の楽曲カードが合計で２色以上あるなら、共通スコアが４減る。','[Live Join] If all Members on your Stage are \"Maki\" cards, and the face-up Song cards that are in your Set List or Live on your Stage have two or more different Attributes in total, the Any Piece requirement is reduced by 4.'),
(1263,'EX15-E16',NULL,0,407,'【ライブ参加時】あなたのステージにいるメンバーがすべて「希」で、この《ライブ》に参加するメンバーが【☆】を合計３個以上持つなら、共通スコアが４減る。','[Live Join] If all Members on your Stage are \"Nozomi\" cards and the Members joining this ⟪LIVE⟫ have a total of three or more Stars, the Any Piece requirement is reduced by 4.'),
(1264,'EX15-E17',NULL,0,408,'【ライブ参加時】あなたのステージにいるメンバーがすべて「花陽」で、この《ライブ》に参加するメンバーが【緑】を合計３個以上持つなら、共通スコアが４減る。','[Live Join] If all Members on your Stage are \"Hanayo\" cards and the Members joining this ⟪LIVE⟫ have a total of three or more [PURE], the Any Piece requirement is reduced by 4.'),
(1265,'EX15-E18',NULL,0,409,'【ライブ参加時】あなたのステージにいるメンバーがすべて「にこ」で、この《ライブ》に参加するメンバーが合計で、【赤】と【緑】と【青】を１個以上持つなら、共通スコアが４減る。','[Live Join] If all Members on your Stage are \"Nico\" cards and the Members joining this ⟪LIVE⟫ have a total of one or more [SMILE], [PURE] and [COOL] each, the Any Piece requirement is reduced by 4.'),
