(1463,'PR-242',NULL,0,1,'【登場時】手札から「花丸」１人を《登場》してよい。','[Entry] You may ⟪ENTER⟫ one \"Hanamaru\" Member from your Hand.'),
(1464,'PR-243',NULL,0,1,'【登場時】手札から「ルビィ」１人を《登場》してよい。','[Entry] You may ⟪ENTER⟫ one \"Ruby\" Member from your Hand.'),
(1465,'PR-244',NULL,0,1,'【登場時】手札から「果南」１人を《登場》してよい。','[Entry] You may ⟪ENTER⟫ one \"Kanan\" Member from your Hand.'),
(1466,'PR-245',NULL,0,1,'【登場時】手札から「善子」１人を《登場》してよい。','[Entry] You may ⟪ENTER⟫ one \"Yoshiko\" Member from your Hand.'),
(1467,NULL,1,0,296,'【自動】ペアになったとき、ペアになった「梨子」は、あなたのステージにいる「善子」１人の【登場時】スキル１つを使用する。','[Auto] When this Pair is formed, this Pair\'s \"Riko\" card uses the [Entry] Skill of a \"Yoshiko\" card on your Stage.'),
(1468,NULL,2,0,297,'【ライブ参加時】あなたのステージに【LIVE】を持つメンバーが３人以上いるなら、この《ライブ》に参加する『３年生』のメンバー１人に＋【オール】する。','[Live Join] If there are three or more Members with [LIVE] on your Stage, one \"3rd Year\" Member joining this ⟪LIVE⟫ gains +[ALL].'),
(1469,NULL,2,1,43,'【ライブ成功時】もう１回ターンを行う。','[Live Success] Take another turn.'),
(1470,NULL,3,0,298,'【自動】ペアになったとき、あなたのセットリストにある裏向きのカード１枚を表向きにする。','[Auto] When this Pair is formed, flip one face-down Song card in your Set List face-up.'),
(1471,NULL,3,1,9,'【ライブ参加時】あなたのコレクションから「{{mem:#9 Awaken the power}}」１枚をステージに出してよい。','[Live Join] You may bring one \"{{mem:#9 Awaken the power}}\" from your Collection to your Stage.'),
(1472,NULL,4,0,299,'【自動】ペアになったとき、あなたのセットリストにある表向きの楽曲カードが２枚以下なら、『あなたのセットリストにある裏向きのカードをすべて見る。その中から「Aqours」の楽曲カード１枚を表向きにして、残りを裏向きのままよく混ぜる。』を行う。３枚以上なら、『このペアを参加させて《ライブ》してよい。』を行う。','[Auto] When this Pair is formed, if there are two or less face-up Song cards in your Set List, look at all the face-down Song cards in your Set List and flip one \"Aqours\" Song card face-up, then shuffle the other cards and flip them face-down again. If there are three or more face-up Song cards in your Set List, you may perform a ⟪LIVE⟫ with this Pair.'),
(1473,NULL,5,0,300,'【自動】トリオになったとき、あなたのライブPが３点以上なら、このトリオを参加させて《ライブ》してよい。','[Auto] When this Trio is formed, if you have three or more Live Points, you may perform a ⟪LIVE⟫ with this Trio.'),
(1474,NULL,5,1,301,'【ライブ中】このトリオが参加している楽曲カードを♪ライブP＋１♪する。','[While Live] The Song card used for the Live this Trio is in gains ♪Live Points +1♪.'),
(1475,NULL,6,0,302,'【ライブ参加時】この《ライブ》に参加するメンバー１人に＋【オール】する。','[Live Join] One Member joining this ⟪LIVE⟫ gains +[ALL].'),
(1476,NULL,6,1,8,'【ライブ成功時】あなたのステージに「{{mem:変わらない思い}}」がないなら、あなたのコレクションから「{{mem:変わらない思い}}」１枚をステージに出してよい。','[Live Success] If \"{{mem:Unchanging Feelings}}\" is not on your Stage, you may bring one \"{{mem:Unchanging Feelings}}\" from your Collection to your Stage.'),
(1477,NULL,7,0,2,'【ライブ成功時】あなたのステージに「Aqours」のメンバーがいるなら、手札から【☆】を持たないメンバーを２人まで《登場》してよい。','[Live Success] If an \"Aqours\" Member is on your Stage, you may ⟪ENTER⟫ up to two Members without Stars from your Hand.'),
(1484,'LL16-051',NULL,0,348,'【特別練習】【☆】を持たない「善子」','[Special Practice] With a \"Yoshiko\" without Stars'),
(1485,'LL16-051',NULL,1,542,'【登場時】あなたの待機中のメンバーの人数が偶数なら、このメンバーを参加させて《ライブ》してよい。奇数なら、カードを３枚引く。','[Entry] If the number of Members on Stand-By on your Stage is even, you may perform a ⟪LIVE⟫ with this Member. If it\'s odd, draw three cards.'),
(1486,'LL16-046',NULL,0,349,'【特別練習】このターンに《登場》した「千歌」','[Special Practice] With a \"Chika\" that was ⟪ENTER⟫ed this turn'),
(1487,'LL16-046',NULL,1,537,'【登場時】どちらかを行う。このメンバーが覚醒済みなら、どちらも行う。①カードを２枚引く。②このメンバーを参加させて《ライブ》してよい。（どちらも行うなら、①から行う。）','[Entry] Do either, or do both if this Member is Idolized: ① Draw two cards. ② You may perform a ⟪LIVE⟫ with this Member. (If you do both, do ① first.)'),
(1488,'LL16-048',NULL,0,351,'【特別練習】【LIVE】を持つ「果南」','[Special Practice] With a \"Kanan\" with [LIVE]'),
(1489,'LL16-048',NULL,1,539,'【ライブ成功時】このメンバーが覚醒済みなら、手札から【☆】を持たないメンバー１人を《登場》してよい。','[Live Success] If this Member is Idolized, you may ⟪ENTER⟫ one Member without Stars from your Hand.'),
(1490,'LL16-049',NULL,0,353,'【特別練習】【☆】をちょうど１個持つ「ダイヤ」','[Special Practice] With a \"Dia\" with one Star'),
(1491,'LL16-049',NULL,1,540,'【登場時】あなたのセットリストに、スキルに「{{skilltext:Aqours}}」と書かれている表向きの楽曲カードがあるなら、カードを２枚引く。このメンバーが覚醒済みなら、さらに手札からメンバー１人を《登場》してよい。','[Entry] If there is a face-up Song card in your Set List that contains \"{{skilltext:Aqours}}\" in it\'s Skill text, draw two cards. Then, if this Member is Idolized, you may ⟪ENTER⟫ one Member from your Hand.'),
(1492,'LL16-050',NULL,0,354,'【特別練習】ライブ衣装ではない「曜」','[Special Practice] With a \"You\" without a Live Costume'),
(1493,'LL16-050',NULL,1,541,'【登場時】このメンバーが覚醒済みなら、このメンバーとあなたの待機中のライブ衣装のメンバー１人を参加させて、そのメンバーのライブ衣装と同名の楽曲カードを《ライブ》してよい。','[Entry] If this Member is Idolized, you may perform a ⟪LIVE⟫ with this Member, a Member with a Live Costume on Stand-By on your Stage, and a Song card with the same name as that Member\'s Live Costume.'),
(1494,'LL16-052',NULL,0,352,'【特別練習】【RUSH】を持つ「花丸」','[Special Practice] With a \"Hanamaru\" with [RUSH]'),
(1495,'LL16-052',NULL,1,543,'【登場時】このメンバーが覚醒済みなら、あなたのコレクションから【RUSH】を持つ「花丸」１人を全員に見せて手札に加えてよい。','[Entry] If this Member is Idolized, you may show one \"Hanamaru\" card with [RUSH] from your Collection to everyone, then add it to your Hand.'),
(1496,'LL16-053',NULL,0,355,'【特別練習】【オール】を持たない「鞠莉」','[Special Practice] With a \"Mari\" without [ALL]'),
(1497,'LL16-053',NULL,1,544,'【ライブ参加時】このメンバーが覚醒済みで、この《ライブ》に持っているピースがすべて【オール】のメンバーが２人以上参加するなら、＋【オール】【オール】する。','[Live Join] If this Member is Idolized, and two or more Members joining this ⟪LIVE⟫ only have [ALL] Pieces, gain +[ALL][ALL].'),
(1498,'LL16-054',NULL,0,356,'【特別練習】このターンに《登場》した、ピースをちょうど１個持つ「ルビィ」','[Special Practice] With a \"Ruby\" that was ⟪ENTER⟫ed this turn and with exactly one Piece'),
(1499,'LL16-054',NULL,1,545,'【登場時】このメンバーが覚醒済みなら、カードを３枚引く。そうでないなら、このメンバーを手札に戻し、デッキの１番上のカードを《登場》する。','[Entry] If this Member is Idolized, draw 3 cards. If not, return this Member to your Hand, and ⟪ENTER⟫ the top card of your Deck.');
